    "text": "I\\'ve never eaten the food at Sugar Factory but I have visited for their drinks. They have awesome goblet drinks that are full of candy and are super delicious! We ordered their lollipop passion goblet which is described on the menu as \\\"a wonderful mix of melon, coconut and pineapple blended together to create a taste sensation no one will be able to resist! Garnished with lollipops\\\" Our goblet came to the table and it is huge, I am glad the husband and I decided to share this drink. It had two huge rainbow lollipops and a candy necklace inside. The server pours our drink and we were surprised it had some kind of dry ice or something in it to make the drink bubble and smoke. (It was super neat) We had great service, the woman who took care of us was very attentive even though we only came in to order a drink to share. The drinks are expensive though and I wish I knew beforehand that yelp has a special. If you check in on yelp you get 50% off your goblet drink, which would have saved us at least $25, but you live and you learn! Next time I would for sure use the check in offer if it is still available. \\nOverall the drink was super refreshing and not too sweet. We will return. The decor of the restaurant is super cute, they have awesome looking food and great service.",
