    "date": "2010-07-21 00:00:00",
    "text": "Man.. I\\'m drooling just thinking about the wonderful birthday meal I had here (courtesy of dearest Hubby).\\n\\nI loved how the theme of the restaurant was very New Orleans/Cajun inspired.\\n\\nBefore we even ordered, we got to try these ox tail thingies, compliments of the chef. Pretty good.\\n\\nWe started with the BBQ shrimp. Delish.\\n\\nI had the filet, and Hubby had the bone-in filet. According to him, it was extremely good, and he liked it better than the bone-in at Fleming\\'s. I absolutely loved my filet. It had a cajun spice flavor, and it was so good that I didn\\'t even want to dip it in Emeril\\'s version of A1 sauce (yeah.. it\\'s an Emeril restaurant.. didn\\'t know that till I looked at the menu, and I admit initially I was a little turned off by that).\\n\\nWe shared asparagus and mushrooms as sides, and their mushrooms were superb. They didn\\'t use the button mushrooms that most steakhouses use. Instead, I think they were shiitake mushrooms, or some sort of mushrooms that tasted similar/looked similar to shiitake mushrooms. Either way, very good.\\n\\nWe ended the meal with a complimentary sorbet that was yum, and we also ordered their dessert of the night, which was a blackberry cheesecake that was yum as well.\\n\\nLastly, according to Hubby, they had a great wine selection.",
