    "text": "Ordered the seafood tower at $130 came with oysters on the half shell, 2 lobster tails split in half which were slightly overlooked and rubbery. A handful of shrimp which tasted farm raised and lacked a good wild shrimp taste. Tuna tartare was great and the crab legs were great.\\n\\nWarm wilted spinach salad ($15) came out with a deep fried soft boiled egg and bacon with candy pecans baked on it. There was spinach in there but a 2000 calorie salad isn\\'t really that much of a salad. Still it was good.\\n\\nAdded to that the bone in 45 day aged ribeye ($50). That was magnificent. Huge, flavorful and all around award winning.  Had the creamed spinach ($10), creamed corn ($10) and steak fries ($10). The creamed corn want good. It was just bland. The rest were good.\\n\\nService is exceptional. Had a few Tito vodka Martina\\'s with blue cheese olives as well Jacob were expertly made. For 5 of us the total bill was close to $1000. Be prepared to spend $$$.",
