    "text": "I ordered \\\"banh tam\\\"...which I usually have to make it at home because not all restaurants have it. I usually make mine w/shredded pork (bi) and meatballs (shrimp and ground pork). Well, this place didn\\'t make it w/ meatballs, but it came with grilled pork! My eyes were wide open and I indulge right away! It was one of the best banh tam I ever had! I never thought of having grilled pork with it! Awesomness!!! Banh tam is served with mixed vegies, coconut milk, and nuoc mam (fish sauce). And they offered 2 free eggrolls if you check in! :)",
