    "user_id": "FmoHNtcIw6reY7IX5eV97g",
    "stars": "5",
    "date": "2013-02-27 00:00:00",
    "text": "I came here with some girlfriends during my Bachelorette weekend in Vegas. We had a reservation for 7 girls, and were very promptly sat at our reservation hour.\\n\\nThe service here is spectacular, and the food is equally enjoyable. My girls and I shared our entrees and side dishes, so that we could each have a taste of a little bit of everything.\\n\\nEntrees:\\n- FILET MIGNON - 9 oz, and absolutely melt-in-your-mouth yummy. This cut was like BUTTER.\\n- EMERIL\\'S BBQ SALMON - Also melted like butter with every bite. It was amazing how tender, yet well-cooked the fish was. The hash side dish that came with the meal was very complimentary!\\n- GRILLED MARINATED ORGANIC CHICKEN BREAST - Mostly juicy (a teeny bit dry), but great flavors. The fingerling potatoes were pretty standard, and the wild mushrooms weren\\'t very tasty to me.\\n- BONE IN RIBEYE - 20 oz, and great for sharing! Our waiter even cut the steak for our girls so that each could have medium rare/well.\\n- AMERICAN RED SNAPPER - the sides didn\\'t seem as appealing at first for my friend who had this dish, but she ended up enjoying them!\\n\\nSides:\\n- CREAMED CORN GRATIN√âE - delicious. A great combination of that sweet and salty flavor. Texture was right on point!\\n- BUTTERED FRESH ASPARAGUS - fabulous crunch, and not so much flavor added to cover up the natural enjoyable flavor of the veggie\\n\\nAll in all, a great experience. We weren\\'t too full at the end of the meal, and didn\\'t have to worry about wasting any food or taking back any leftovers.\\n\\nHighly recommended!",
    "useful": "4",
    "funny": "1",
    "cool": "2"
