    "text": "This place is terrible.  Why do they make such a big deal about portion sizes when the burger basket is basically a Burger King size.  Don\\'t get me wrong, it\\'s filling af, but not to the degree that they try and sell it to you and market it to you.  Don\\'t waste your money here.  You are paying for the experience, and honestly, you can get the same amount of food at Burger King, same quality.  The manager won\\'t harass you for leaving a review on yelp and stare at you every time you walk by the establishment.  The Burger King manager doesn\\'t care.  Black bears manager?  Takes it personally and makes you feel sorry for having a bad experience.  Too bad.  \\n\\nIf you would like a place to hang out after Burger King, check out a coffee shop, go to the library, or take some yoga at RYK, right across the street.  You will spend the same amount of money (because black bear is over priced for its portions), and you will feel social:-))",
