    "user_id": "9IX2jJzDNvODLA9EzSKV5A",
    "stars": "4",
    "date": "2017-11-22 00:00:00",
    "text": "Finally got to try the sushi burrito (I know I\\'m a few years late). I didn\\'t want to fall into the gimmick of paying more money for something just because it now comes in a different shape / form. Plus some places are stingy and will give you a tiny portion. Not Jaburritos! I shared the Redondo (ahi, salmon, yellowtail) with my boyfriend and was surprised by how full I got just eating half. The fish was fresh, and I was able to taste it in every bite (so it wasn\\'t just a bunch of fillers). Not bad for $13. It\\'s essentially the same price as a specialty roll.\\n\\nWe also ordered the sushi cupcakes. It came with 4: crab, smoked salmon, and 2 spicy tunas. The \\\"cup\\\" part is fried wonton skin, and the \\\"cake\\\" part is the seafood and rice. Pretty good, but a little too much sauce on all of them, so it was quite heavy. But kudos for creativity. Not sure how comparable other sushi burrito places are, but this was a great first experience!",
