    "text": "As I deal with my Hawaii withdraws I am reminded about what makes so many restaurants great on the islands. For The Rice Shop it isn\\'t it\\'s premium location hidden in the burbs, it\\'s luxurious interior, or that its decorated from ceiling to floor in nonexistent fine antiques. The Rice Shop is great because it takes elements from many cultures, combines them together in a way that compliments each other, and executed nicely. No swooshes of weird green sauces, just plenty of greens to make up for that lack of daily vegetable serving. \\n\\nMy go to\\'s are the Mochiko chicken and Kentucky fried fish. There are less than 10 seats, it\\'s an one man army, everything is served in paper containers, and smells great.",
