    "text": "First time eating at a Rollin Smoke per suggestion of my father in law. He was always a fan of the OG place on Highland Dr? The menu was pretty simple & they had good platter selections.\\n\\nMy only complaint was that our food wasn\\'t hot? It was warm, as if it\\'s been sitting out & they put it on a plate. I know I like my food to be steaming so I know that it\\'s fresh, or that they took the time to cook it, or that it was in a proper warming container. Just some food for thought.\\n\\nDrinks are $3, but it\\'s because the cups are also souvenir cups. They have Coke products, iced tea & a Keurig machine which was super fancy btw. \\n\\nNot a fan of all their sauces, but don\\'t take that into account I\\'m not much of a BBQ person.\\n\\nI ordered duo meat with sliced brisket & pork with a side of Mac n cheese & bacon potato salad (my favorite). Hubby had same duo meat combo w/ spare ribs & sliced brisket, sides were corn bread (tasted great, but dry) & waffle fries (had a sweet-ish taste). FIL got the whole beef ribs, which were huge but not fall-off-the-bone juicy & the baked potato with bacon, cheese, sour cream & green onions. And lastly, bro-in-law had a duo meat combo as well with corn bread & Mac n cheese.\\n\\nAll of the good tasted good, but I just wish it came out hot! Will try the OG place on Highland and compare.",
