    "text": "Tried this place a couple of days ago since I wanted to try a different Vietnamese restaurant (I\\'m a regular at Pho Saigon 8). Checked on Yelp and it has good ratings. \\n\\nService was at par. Claimed my two free egg rolls via the Yelp app. \\n\\nFood was so so... The egg rolls were fried to death. It was crunchy but dry inside. The nukmam sauce was very diluted with water. \\n\\nI had the pho with sliced meat, flank and tendons. The bowl had more meat than noodles (some people might like it but I like it to have more noodles). The flavor of the broth was so so. You can taste it has a lot of MSG. \\n\\nMy bf had a raw slice of beef in his pho. He said it was 2/5. \\n\\nNo next time for Kinh Do.",
