    "date": "2011-04-12 00:00:00",
    "text": "We arrived at the restaurant close to 9pm on a Saturday night. There wasn\\'t one customer in the restaurant, but that didn\\'t deter us from trying out their foods, since this restaurant had some pretty good reviews from fellow yelpers. I ordered their pho tai with raw beef on the side, spring rolls, com tam bi cha suon nuong (broken rice with grilled pork chop), and bun thit nuong (grilled beef with rice vermicelli and vegetable). We also received two free egg rolls for \\\"Checking In\\\" at their restaurant. The pho lived up to its top ranking, the broth was very flavorful, but they were a little skimpy on the noodles, IMO. My wife\\'s bun also did not have enough vermicelli in it and their fish sauce wasn\\'t as strong as some of the other restaurants in town, but not bad. The spring rolls were delicious and very fresh as was their egg rolls. The pork chop with the broken rice dish was just okay. The eggs that were in this dish was quite good, but the pork chop needed more seasoning. If you come here, stick with the pho and spring/egg rolls.  After our meal, the owner brought out some Vietnamese dessert for us to try, on the house. This broken rice sweet dessert with taro and sweet potatoes were an absolute delight.  15% off my bill because I yelp. I definitely have to come back to try their $3 banh mi.",
