    "text": "There is certainly no lack of good Italian places in Las Vegas but, as this is only a few blocks from our house, we decided to give it a try.  Bring your appetite with you!  If you\\'re eating in, they start you off with complimentary breadsticks, which is fried pizza dough flavored with garlic and sprinkled with parmesan cheese on top.  Delicious! If you\\'re really hungry, their deep dish pizza was good and one slice is enough to fill you up!  We ordered the meat classic deep dish and it had plenty of meat toppings but my favorite was the thick layer of chunky tomato sauce on top. We\\'ve tried their thin crust pizza, chicken parmesan, and balsamic chicken panini which have all been delicious.  Service has been great the times we\\'ve been there and they refilled our drinks without us having to ask.  We have since gone back for more!",
