    "text": "We happened upon this place by accident and I\\'m so glad that we did!\\n We had read the Yelp reviews as we were sitting in the car deciding whether or not to go in. Most of the reviews raved about the calamari steak, so of course, we had to try it! We ordered the calamari steak appetizer and it was easily one of the best things I\\'ve eaten in a long time. Not only was it delicious,  but it was also very beautifully presented. \\nNow, on to the main dishes... My husband ordered the chicken tagine.  The chicken was so tender and juicy and the sauce was so yummy. I ordered the chicken brochette,  which is basically a kabob.  Once again, the chicken was tender and juicy and the spices that it was cooked with gave it a great flavor. It also came with saffron rice, potatoes and an incredibly yummy tomato topped with parmesean cheese and spices. For dessert,  we ordered the panna cotta. It had a great citrus flavor and was very refreshing- the perfect ending to an amazing meal!\\nWe also ordered a bottle of the Moroccan wine, which perfectly complimented the flavors of our meal. At $45/bottle,  it was totally worth it.\\nThe staff was just as great as the food. From the host who greeted us at the door to the waiter to the owner, everyone was so friendly and made us feel very comfortable.  \\nWe are already looking forward to going back! Next time,  I\\'m getting the braised short ribs!",
