    "text": "Do you love BBQ? i do. After a disappointing attempt to get my bbq fix on the other day I finally got it on here.  You can pretty much get bbq at any buffet around town but this is my usual spot with the buffet at south point. Beef and pork bbq ribs, brisket please.  They have other food also but I\\'m here for bbq overload.  Also recommend their variety of ice cream flavors. \\n\\nMaybe the cheapest All Day buffets in town, you can eat breakfast, lunch, and dinner as many times you want ALL DAY LONG and it\\'s only $24.99.  Dinners by it self starts at 13.99. \\n\\nI would not recommend their Friday seafood buffet the crab are thinly sliced and not much difference between the regular days other then the price. Try another place if your looking for a Friday seafood buffet as almost every buffet in town have a Friday seafood special",
