    "text": "My wife and I have been hearing good things about this place for a while and finally decided to try it for ourselves. There is paid on-street parking not too far from the restaurant (if you\\'re driving there and not staying someplace downtown). \\n\\nIt was well worth the trip. I had the short rib fried rice and my wife had the pad thai, both of which were excellent. We also shared the Waterfall Beef appetizer, which was also delicious. The prices are very reasonable for being downtown and they had some pretty good happy hour specials (M-F from 3-6) too. The service was also good. Everyone was attentive and friendly. \\n\\nThere are a few downsides to know about if you decide to come try it out. One, it\\'s super small. They have a takeout window up front so you can conveniently get it to go, but I\\'d be surprised to hear if the max capacity was any more than 40 people. So if you go when it\\'s busy, expect a wait. Two, there are only 2 or 3 tables inside (plus the bar); everything else is outdoor seating. However, I will admit that it was over 100 degrees the day we went and the beer garden (aka an enclosed rear courtyard with a canopy and misters) was surprisingly comfortable.",
