    "stars": "5",
    "date": "2015-01-19 00:00:00",
    "text": "I\\'ve eaten here a total of 4 times and today is the day I finally write my review and it\\'s all because of this one thing that just blew me away-banh mi! \\n\\nFirst 2 times I got pho. Really good but didn\\'t blow my socks off. Third time I wanted to try a noodle soup dish but decided to stray away from my usual. I ordered the bun bo hue. The flavors were really good and melded together well but I think it was overly seasoned and slightly too thick. It was a heavier stew than what I am used to with this dish. My son had the combination fried rice. We have had fried rice in every Viet restaurant in Vegas and I would say by far, this one would be in the top 2. \\n\\nToday on this cold night I ordered a bowl of pho. It was slightly sweeter than I remembered but still good as is evident in my empty bowl. I ordered the banh mi thit nuong and a thai tea to go. When I finally tried the banh mi I was so impressed! Even as a cold sandwhich I was so happy to finally find a good banh mi in this town. The pork was a thicker cut but so incredibly tender and flavorful. It is reminiscent of a Thai beef jerky a while back but way more unctious and tender.  It is quite obvious that the marinade is comprised of many different ingredients that make it so complex that my mind and tastebuds were trying to catalogue what was all in it. Lemongrass is definitely a top ingredient that makes the meat so fragrant.  This is so beyond fish sauce and sugar like some other places :-/ The mayo seemed fresh, the pickled veggies and fresh greens just put it over the top. I\\'m so glad I finally got the banh mi. Now I know where to get them from now on!",
    "useful": "2",
    "funny": "0",
    "cool": "0"
