    "text": "First impressions......Unfortunately, Delmonico Steakhouse made a huge mistake when they seated my party of three at the table right in front of the kitchen door with a restaurant that was less than half full.  Offensive and unacceptable.  The hostess ran in one direction and a staff member told us we would have to make our way back up to the front to deal with this issue when we told them that this would not work for us.  After a word with someone who claimed to be the manager at the front, we were reseated and promptly given complimentary truffle chips (that can solve any bad first impression).  The truffle chips are not to be missed.  \\n\\nService-  Our server eventually warmed up and was pleasant.   He was so caught up in his speeches about different parts of the menu and recommendations, that it took some time to see his true personality.  He was also rushed, which was odd, as we had some menu questions.  \\n\\nFood-  The filet was magical.  This is the primary reason that the restaurant got 4 stars.  The creole seasoning and dab of BUTTER on the steak were an amazing and sinful treat.  Really delicious.\\n\\nThe cheese grits were delicious.  I was a bit less impressed with the creamed spinach.  The waiter said that it was better than CUT\\'s version.  NO WAY!  Underwhelming.",
