    "text": "Great Steakhouse. I was delighted to come and try this place. I haven\\'t heard too much about what the steak was like hear but I heard all good things about it. \\n\\nAs we sat down we were great by two men who were going to be our servers and our waiters for the day. I ended up ordering a Bone In rib Steak. I think it was the most expensive steak on the menu. I wasn\\'t too sure about the size but my friends that came before said that it was a good size and that some of them couldn\\'t finish it. \\n\\nWhen I finally got the steak. It had a little piece of butter on the top and it looked good. I usually have my steak medium and it was perfect. I loved it. We also ordered some sides of grits, spinach and mushrooms. Those were ok to me. I loved the steak though. I wasn\\'t able to eat the last 3 oz or so. I think it was well over 16 oz steak with the bone. I think everyone finished theirs except for me. I did notice that my friend said the my steak looked bigger. I couldn\\'t complain at all. All in all we spend about $80 for dinner. I didn\\'t order anything besides the steak and splitting the appetizers. \\n\\nIt was well worth it. I have spent more at other places and not even felt like I was eating enough. This takes the cake. \\n\\nI liked how the servers were prompt with filling up my water and attentive to our needs. They would even fold your dinner napkin if you left the table. Awesome. I felt somewhat cramped on our circular table, but what do you expect from a large group of 9 guys.",
