    "text": "As a beer geek, I made the trek way off the strip to Aces and Ales...and when I say way off the strip, it is WAY OFF the strip. However, once I found this hole in the wall, hard to miss location with it\\'s huge sign, I found a very unpretentious place to enjoy an amazing beer, or two, or three (actually, I had five the day of my visit). \\n\\nThe beers come from all over...though they don\\'t have many taps and virtually no bottles, all the beers are great!!! \\n\\nThe wait staff is friendly, though not always knowledgeable about what is on tap...but who cares. All I need my wait staff to do is pour the beer, hand it to me, and then leave me alone as I sip and enjoy. \\n\\nI also had lunch here, which is not recommended unless you really love bar food (I do not!). Some items on the menu seem over priced, but you could care less if you\\'re hungry and need something to wash down all that beer with!!!\\n\\nIf you love beer and have time to drive off the strip, make sure to visit Aces and Ales!",
