    "text": "I was there in July 2006 so this review is a little dated but...\\nMy wife and I decided to give it a try being we were guests in the hotel.  We sat at the bar ordered a margarita for her and a beer for myself along with 2 Don Julio shots, after about 13 minutes my wife told me she couldn\\'t feel her feet! (Uh-Oooh little did we know we\\'d be there for another 3 hours) After a few more shots we moved to a table for waiter service because we now had the munchies.  He informed us of the shot specials that had the bartender told us about we would\\'ve saved money, oh well live and learn.  I remember the food being pretty good but I think its safe to say I was buzzed and my wife was trying to figure out who I was.  We had about 12 top shelf shots, 1 mixed drink and 2 beers between us, the walk back to the room was challenging. To this day my wife says she felt fine the next day and didn\\'t have much of a hangover, then I remind her she didn\\'t wake up till 5PM the next day.... we still talk about that place. I\\'d give it 6 stars if I could because it was fun and has a great selection of Tequila, who cares if the place looks boring and It doesn\\'t have the feel of a nightclub. Go with the right person you\\'ll have a great time.",
