    "stars": "4",
    "date": "2012-12-28 00:00:00",
    "text": "Oh yes, this little joint deserves the praise! Frozen and hungry, we were searching for something warm and spicy. We found Le Thai, a small and casual gem. Tiny dining area, so we had to eat outside in jackets in a screened patio area with heaters( a small inconvenience). I eat Thai often(NY, NJ), but this was one of the best and even slightly unique. The Penang curry tasted like homemade- mild and creamy, and transparent flavors(no mystery sauces). Kee Mao was not sticky like other places but actually juicy and refreshing with all the veggies. I also had a salad, I think pork with lettuce and dressing...forgot the name, but was nice and lemony. However, they missed the soooo delicious peanuts. They should consider adding them for another layer of flavor and texture.\\nThai iced tea could have used less brewing or steeping time, it was a bit bitter.\\nThumbs up Le Thai!\\nOh, a little fun fact: all their menu sections are prefixed with Le. So it will say Le Beverage, Le other Beverage, Le Salad. I found it amusing and nice.",
