    "text": "So I came here today for lunch with friends after they said they enjoyed the place previously.  Came in, were sat immediately, and then waited around 15 minutes to order, which was seriously annoying, especially as almost everyone who got seated after us were able to order first.  I had the spicy miso ramen, extra spicy, and they weren\\'t kidding, it was spicy, but that\\'s ok, I\\'m a bit of a chili head.  The waitress told us that some people thought it was too salty, so she recommended getting hot water on the side.  I didn\\'t think it really needed it, but I used it anyway, and the full flavor was still there.  The noodles were cooked well, but I wish there had been more of them.  I finished them way before I was even halfway through the broth.  Overall, meal was fine, but I think there are better ramen restaurants around town.\\n\\nFood = 3 stars\\nService = 2.5 stars\\nAmbiance = 3 stars",
