    "text": "Herringbone has been on my radar for a long time and I finally got to try it this past weekend for lunch.  I must say that my initial reaction to their menu was shock... it is not quite \\\"American\\\" only, which is what makes Herringbone amazing.  As I researched for places to eat, I noticed that Herringbone was marketed as an American seafood restaurant, which to be honest does not sound exciting to me.  But the truth is that this place is a fusion restaurant with dishes from all over the world.  We had the Hamachi, beef tartare with truffle, chilaquiles, ceviche, moco loco, lobster roll, and a few other things that I can\\'t remember right now.  The Hamachi and ceviche were out of this world.  Chilaquiles was beautiful, but taste wise it was ok.  Lobster roll was great.  We inquired about mussels since I had seen those in Yelp but it wasn\\'t on the menu.  The waitress asked the chef if they could do mussels during lunch and he said yes.  However, we decided that we didn\\'t want mussels in the end... so to our surprise, the chef came out with a dish of mussels and said it was on the house since they had already started preparing it before we decided we didn\\'t want mussels.  Chef was super nice and the waitress was as well.  Overall, I was very happy with my experience and the food.  Definitely a place I would try over and over again.",
