    "text": "I cannot say enough about the service here. I was recently here for dinner with my sister while on vacation and thought I\\'d stop by here due to the amazing reviews. The restaurant was pretty packed as we entered. As we were seated, I noticed that we were not handed a menu. So we sat and waited about 15 minutes before being given a menu. We were basically left to sit in the corner for about an additional 20 minutes. I was a little confused as to why things were taking so long. I mean the reviews on Yelp were really good. The customer service I found was extremely lacking, as our order was taken the waitress walked off and had not asked us if we wanted anything to drink. So I had to ask her myself. I told her that me & my sister wanted water and she returned 5 minutes later with bottle water (which a glass of free water would have been sufficient) The food took a while to come which did not surprise me at this point. The food was good not GREAT!!! The portion was large which is probably the only reason I gave them 2 stars. After we finished our meal, we could have basically walked out of the restaurant, I doubt they would have noticed anyways with the way things were going. I walked up to the counter and stood in front of the cashier to pay my bill. She took her sweet time and didn\\'t even realize I was there until one of her co-workers pointed it out to her. From here it took her about 5 minutes to hand me my bill and change. She did not even say thank you when she gave me my change. No tip was given obviously. I would not return to this restaurant due to the poor service.",
