    "text": "Last week we took the in-laws there for a pre Mom\\'s day celebration. We were not looking to over eat, as we had a full evening planned. We started with the shell fish appetizer which had a variety of samplings which were wonderful. We ordered a steak/lobster tail per couple, to be shared, for dinner. We thought that with the two sides that we ordered - mushroom risotto and brussel sprouts - we would be just full enough. When the meal arrived the lobster wasn\\'t there. We asked the waiter and he advised that they were out of lobster AT 6 IN THE EVENING!  I asked he waiter why he didn\\'t mention this before the meal arrived, as we may have changed our order. He had no answer, but apologized.\\n\\nNow, to be fair, the steak was good. Not amazing as expected, but it was fine. The sides we delicious, but we never did really rebound from our disappointment over not having lobster at a restaurant known for its seafood. The worse part is that when we left there were several people eating lobster!!!!!\\n\\nThe waiter did bring us a delicious desert, and the meal was comped by the amazing Bellagio thanks to our gambling, so I really have no reason to complain. However, word to the wise, if you are going to spend $400.00 on dinner, you may have better options on the strip.",
