    "text": "It\\'s inadvertently become a New Years Eve tradition for the family to enjoy a meal together at Hong Kong Garden on Jones. Of course, we also visit periodically throughout the year but New Years Eve includes about 13 of us. Thank you to Hong Kong Garden for accommodating us!\\n\\nA complimentary house soup is served table side, and there\\'s always a scramble as several family members vie for a bowel with the coveted chicken feet. I\\'m impressed by how clean the bones are when they\\'re done!\\n\\nI\\'m addicted to their salt & pepper calamari - it\\'s seasoned and fried perfectly! We also always order clams - this year we ordered them two ways: one in a black bean sauce and one in a ginger sauce. Both were very good! The vermicelli noodles were also a hit, and my Dad ordered the orange peel beef, which was very tasty. We usually order the bok choy, but since they were out we tried the snow pea leaves with garlic and they were such a hit they quickly disappeared, as did the bar-b-que fried rice.\\n\\nThe Peking duck is delicious (thank you for accommodating all 13 of us with one order!), and the remaining duck was happily enjoyed after devouring the delightful duck served with scallions & cucumber wrapped in delicate white pancake.\\n\\nWe tried a new hot pot this year of pork and mushrooms. This particular hot pot had a more delicate flavor and lots of rice.\\n\\nWe finished our meal with a complimentary serving of black bean tapioca, and it was a perfect way to end a very enjoyable meal!\\n\\nHappy New Year!",
