    "text": "Asked front desk at Bally\\'s where to go for dinner he suggests BLT steak and tells us the chef was the last winner of Hell\\'s Kitchen which we are fans of especially Gordon I love him he reminds me of my father that died recently .  We thought we were going to have a great experience.  It started off ok.  Our bartender wasn\\'t the friendliest guy.  I asked what they had for reds and he turned around without a word grabbed a menu then slapped it in front of me.  So far weird but the signature BLT drink with the dried orange was so good and I thought things would get better when we got a table.  When they brought us to our table we passed by several very open areas scattered with people comfortably enjoying their meals.  We were sat against the wall next to the kitchen sandwiched between 4 other tables maybe 18 inches away from each other if we were lucky.  My husband told me next day that that actually put him in bad mood which is funny because I was also really bothered by that but I kept it to myself thinking it would get better.\\n\\nIt keeps getting worse.  Waitress Margo I Think was nice enough but she didn\\'t care.  She didn\\'t seem to care about anything nor have much knowledge about anything.  She kinda blew off each question I asked her like I asked if the tabouleh was really minty and she said oh no it\\'s not minty at all and I felt like I had to inform her that traditionally it had mint in it it seemed to me like she played it off as if she already knew but I believe she was clueless because it was like ya ya I don\\'t care uh huh how can I get out  of here.  It made me so uncomfortable that I started apologizing that I asked a couple questions.  Then my husband makes 3 attempts to be friendly and ask her how this or that is and she clearly didn\\'t care and couldn\\'t wait to get out of there.  I said to him each time she doesn\\'t care.  He got mad at me because I kept saying that but he can\\'t help himself to keep trying which is killing me to watch.  So he tries to tell her the pop overs aren\\'t that great to me they are very eggie not very cheesy tasting at all they are like chocolate eclair without the chocolate.  She says ok and walks away.  Maybe she didn\\'t hear him?  She acted like she did.  She spoke English as first language.  My husband did say there were so many people unnecessarily packed next to each other that he had trouble hearing me.  My husband suggested I get the scallops with tabouleh because it\\'s a chalkboard special of night.  I got 2 and 1/2 scallops not really big but on small side of large with maybe 1/2 cup tabouleh.  Scallops were over cooked at least half of the deformed 1/2 scallop was and the tabouleh was just ok the lobster bisque was very tasty but by the time I got to the 2 pieces of lobster claw they were saltier than I would have expected, chewy and definitely over cooked.  The wedge salad was pretty average not something you would expect to come out of Hell\\'s Kitchen.  1 bite of that salad and the waitresses attitude and I just wanted to leave.  She makes mistake of dropping off the 2.6 scallops for the special price of $45 and asks me how things are as I am staring at my plate in Complete disbelief.  Had she been nice and engaged or acted like she cared I might not have been so upset but I pretty much lost it on her and told her that she ruined our night with her attitude and on top of that I said are you serious?  If  had known it was $50 for 2 scallops I never would have ordered it,  if you want to start your night off on the wrong foot and pay lots for nothing then you need to go to this place.",
