    "stars": "4",
    "date": "2013-04-01 00:00:00",
    "text": "Just like at all Michael Mina restaurants, the tasting menu and wine pairings were amazing.  It\\'s like a symphony of food rising until the end and then desert as the perfect finish.  However, having eaten at the Michael Mina in SF and having eaten here, I have to say the service at the SF location was far superior.  That\\'s not to say it wasn\\'t good here.  But it seemed like the staff at the SF location had just the right amount of attention - they noticed when we enjoyed a specific wine pairing more than others and made sure to offer a second glass.  Then the waiter, seeing that we were about ready to leave, actually went out and flagged a cab down for us and held it until we were all ready to walk out the door.  Similar service has happened in SF each of the 4 times I\\'ve been.\\nThis experience is what made me fall in love with the Michael Mina group of restaurants.\\n\\nHowever, it seemed like the staff at the location in Las Vegas, just weren\\'t up to that level.  We waited a good 10+ minutes before seeing someone.  Our table (even though we had a reservation, was not ready upon arrival at the right time, and I had to flag over the waiter a few times to get either more water or a bit more wine.\\n\\nIf the food was anything less than perfect I would have problem given 2-3 due to this service issue, but again, in my opinion, the food is the best I\\'ve ever had.",
    "useful": "0",
    "funny": "0",
    "cool": "0"
