    "user_id": "kWCkJR_xj2av_tS29q-QWA",
    "stars": "4",
    "date": "2012-09-13 00:00:00",
    "text": "Been wanting to go here for a long time so when a media contact/vendor asked me to lunch here I didn\\'t hesitate!  The ambiance was lovely, low light, tasteful decorations, great big leather chairs.  We had water, bbq shrimp, lobster sliders, steak medallions with side of garlic mashed, chocolate layer cake with coconut ice cream for dessert.  \\n\\nBBQ shrimp was delicious!  Had a homemade bbq sauce that was just tangy, sweet and rich enough.  Large shrimp came with about five I think very yummy.  \\n\\nMy entree was the something something steak medallions - (sorry it\\'s not on the lunch menu online and I can\\'t remember exactly what it was called) it was EXTRAORDINARY.  I think after looking through the photos they were the Filet Mignon Medallions - I am a red meat junkie and before this Carnevino was the best steak I ever had - this one ranks right up there.  Perfectly medium rare, flavorful with delicious meaty mushrooms, and as tender as a steak could be.  Just delicious.  Be warned it doesn\\'t come with ANYTHING - just the meat so be sure and order a side dish or two.  I ordered the garlic mashed potatoes which come in this cool metal pan/dish thing.  They are a very large portion so that was good.  The mashed potatoes were soooooooooooooo creamy.  Very very good.  \\n\\nWe ordered the chocolate layer cake with coconut ice cream for dessert.  This is why I gave only four stars - the cake a\\'ight.  Nothing special.  It was enormous though so you\\'ll get the bang for your buck.  My sister is a pastry chef so I might be a little extra picky on my dessert but there you have it.  \\n\\nFor what we ordered plus my vendor ordered an additional 3-scoop bowl of coconut ice cream on the side it came to $91.  It\\'s pricey - so be sure to eat the warm bread they give you at the beginning so you can be full, lol.  But the portion sizes were generous, the service was INCREDIBLE and the food delish.",
