    "text": "Holy crap, it was how much?! Sure, I liked the food there but in the future I think I will save my money and grab a cheaper slice of pizza at one of the fast food joints. I should have known it wasn\\'t going to be cheap, its Vegas. I just can\\'t see spending that much on casino food more than I had to. I still have yet to find a restaurant that blows me away in this city. It is probably the best food you\\'ll get in the area but I wish they had a line for the one-platers, the ones not out to stuff themselves to get their money\\'s worth...",
