    "stars": "4",
    "date": "2015-04-01 00:00:00",
    "text": "Delmonicos is a great restaurant, there is no doubt about that. I ordered a Bone in Rib eye medium rare.  The steak was cooked to perfection.  I felt it lack the salt and pepper seasoning on the crust.  I ended up having to get some finishing salt to give it a little more flavor.  \\n\\nI will go there again if I stay at the Palazzo, but I still have a preference to a couple other steaks houses.  service was great, food was great. just thought the steak could have been a little better seasoned.",
