    "text": "Don\\'t let the fact that this place is smaller than your first apartment fool you. The food here is serious stuff.  I had the chance to try three different dishes here and none disappointed. \\n\\nThe sweet/savory interplay that is the Awesome Noodles (and they live up to the name) or the lip-smacking goodness of the Braised Short Rib Fried Rice (even the long name won\\'t derail your enjoyment of this dish-my favorite-) Its all good in this joint that is frequented by both tourists and locals. \\n\\nAlso of special mention is the Pork Jerky appetizer. A plate of fried pork goodness served with a sauce that is everything thai food should be. Mix both in the side of white rice and you might be tempted to forgo an entr√©e and have two servings of this dish. \\n\\nWhether you\\'re a local looking for a place to add to you favorites list or a tourist looking for a true taste of Las Vegas, Le Thai should not be missed.  Highly recommended.",
