    "text": "I went to the buffet when it first opened and was very disappointed. So after a few years now of hearing that the buffet has changed, I decided to give it another try. One reason is that they had a weekend special where the buffet was only $7.00 for Can Club Card holders. So, was the buffet worth $7.00? Yes it was. Was it worth the normally $20.00 they charge for it? Oh no it was not. Some of the food was OK. Most of the food was very low in quality.  I was also a bit confused by the station names. There was the Mexican food station which spilled over to the Italian food station which had almost overtaken the American Food station. I did like the spring rolls and potato soup a lot. The pizza was ok as well as the Orange Chicken. The roast beef though, argh! The beef came out looking like it was 25 lbs of meat. It took a long time to cook and thus it was so dry. Almost no pink in the center at all.\\n\\nOur server was great though. That it why the buffet gets two stars and not just one. Keep up the great service and bring up the quality of the food and I just might go back in the future. But for now, I will just stay away.",
