    "text": "So every casino has a grill that serves breakfast.  So although I love to get out and explore the LV foodie scene, I have neglected the diner-type establishments.  So after attending the Elton John Million-Dollar Piano show, my family was looking for some comfort food.  Wow!, Did we ever find the place!  It was not that crowded at 11 PM (Open 24) on January 1st.  When I picked up the menu, I didn\\'t expect it to be as thick as Melville\\'s Moby Dick, but it was!  This may be the most extensive menu that I have ever seen.  I talked my wife out of the spaghetti, b/c it just didn\\'t seem like an Italian place...but trust me, they even have a page or two of Italian specialties.  My son had a Chicken and Apple Compote Waffle dish, while I had the Meatloaf with sausage gravy with bacon on a biscuit....CULINARY GENIUS.  We did not have room for desert, but the pies and baked goods looked amazing.\\n\\nThis could be the best diner in LV, I know that I am not looking any further!",
