    "stars": "3",
    "date": "2016-12-30 00:00:00",
    "text": "We came here on a Wednesday night for a quick bite to eat prior to watching a movie. We\\'d pass by this place many times on our way to the gym, so I was excited to try it! When we first walked in, I noticed how clean the place was. The bathroom was nice and the toilet paper was thick and soft, which is surprising for a fast food type place. Furthermore, the service was good except the guy who was handling our order was in a rush and made our order wrong... But it\\'s okay. The dinner rush can be rough when there\\'s a lot of people coming by for dinner! \\n\\nFOOD: Imagine a Chipotle style food bar where you tell the associate what you\\'d like. I had the falafal bowl and my husband has the steak bowl. The food was okay. The falafal was cripsy. I added the hummus in my bowl, which was tasty. BEWARE - the green mild sauce is pretty spicy! The red hot sauce just taste hot and lacks flavor. The steak lacked taste. I believe there are better Mediterranean places around town to try with better food and service. \\nIf you check-in, you get a free dessert. They baklava was small. We got the almond one, which was okay. \\n\\nPRICE: For our two bowls and the free dessert it was around $20, which is fair. The portions was pretty big and I had to take half of it home so it was great value. \\n\\nOverall, I give it a 3-star since everything was okay. I probably would not come back though. \\n\\nHappy Dining, \\n\\nJT",
