    "text": "We go to Aces and Ales a few times a month.  The food is fantastic.   The service though can be a little iffy.   So tonight we go to use a groupon that was a gift.   Our \\\"server\\\" Jennilee informs us - in the most condescending tone I have EVER heard that we were 7 minutes too late to use the coupon.  Well we had been sitting at the table and she had ignored us while flirting with some guy at the bar.    She then informs us that she saw us walk in and it didn\\'t matter we were too late and the \\\"system\\\" wouldn\\'t allow the sale.   Well our money spends just as well in a different establishment.  I was ready to leave.   My partner likes the beer selection and after working all day it was time to eat.   Jennilee then disappears after taking our order.  Never asks if we need anything, if we needed more drinks, are we still breathing.   Now the place was not busy.   There was 1 other table, 3 guys at the bar and a few people playing pool.  Jennilee stood at the bar flipping her hair and flirting with a guy.    Total disappointment.   Utter lack of customer service.   The personality of a dead bird.   It\\'ll be a long looonnnggg time before I consider going back.",
