    "text": "Although I don\\'t eat Thai that often I do enjoy the food. I love the flavor and spice. The staff here were really friendly and accommodating. Although this place is really small and you can practically be apart of the conversation of the people at the table next you I still did enjoy my meal. I ordered a Thai Ice Tea which I didn\\'t see on the menu but was happy that they had it. It was good but not great. Could have been a little sweeter. As for the food we ordered the pork jerky whit sticky rice. The sauce this dish came with was incredibly delicious. Tangy, Spicy, and lots of cilantro. We also order the garlic beef fried rice which was also delicious and full of flavor. Everything on the table was level 3 from 0-5 on their spice meter and in my opinion was just the perfect amount to make me have to take a few sips of water and want to come back for more until it was all done. Next time I\\'m on this side of town I will definitely be coming back here.",
