    "stars": "5",
    "date": "2011-02-15 00:00:00",
    "text": "I was wonderfully surprised. I believe this location has 1 Michelin star and I was excited to give it a try. Our party came for the $60 3course Prix Fixe menu. We arrived a little late and they only offer the menu within a short hour between 5-6pm i believe. However the waiter was nice enough to offer the menu anyway. \\n\\nThe ambiance is nice and clean in the restaurant. I had my doubts walking into this place because it was located next to the arboretum at the Bellagio and it was particularly busy that evening.  But the sound from the crowd was nicely muted within the restaurant, I hardly notice all the passerby outside as soon as we sat down. \\n\\nthe menu was great. My brother opted in for the tuna tartare. The waiter mixes the ingredients right infront of you and the dish was fresh and the flavors were vibrant. I opted for their pumpkin soup and grill cheese sandwich. I don\\'t remember what the cheese was but that sandwich was delicious... It was down right magical. The soup was creamy and the flavors were strong. Some might not like it as much if they don\\'t like pumpkin but it sat well with me.\\n\\nSecond course I opted for their lobster pot pie. It was $20 extra I believe but it was totally worth it. They stuck a whole lobster in the pot and baked in its own juices and veggies. The lobster has got to be a good 3lb. I was stuffed from this. The other people in my party got the filet. I can\\'t comment on that dish because I didn\\'t try it. But it did look delicious and my friend said it melted in his mouth. So I\\'m going to assume its good.\\n\\nThe dessert was either the rootbeer float or the chocolate truffle. Both were good. The float had a little waffer straw which was a nice touch. The chocolate was intense but with a very nice texture. \\n\\nthe service was good all around. I am wonderfully surprised with this restaurant. I would not mind returning and trying the Chef\\'s menu next time.",
