    "text": "This food here is terrible. I use to come here all the time when I was in Vegas for their champaign brunch on Saturday or Sunday, but over the last two years this place has gone downhill. The last couple of times I\\'ve been there the food has been bland, dry, & often cold. The deserts are hard, & don\\'t really taste that good. Even the ice cream & jell-o is hard..... Not sure how they managed to pull that off, I guess they want to be consistent at having gross food all the way across the board.\\n\\nIt\\'s looks like they have a wide selection of food here but after walking through you realize it\\'s the same lame food on both sides. The only thing decent about this place is their servers are usually good with following up on you, but all they do is refill the soda like any other server at a buffet is suppose to do so who really gives a sh1t about that. If I\\'m dropping 17-26 bucks on a buffet I want good food not fresh tap water.\\n\\nSo in a nutshell F this place, you\\'re better off taking your money a half mile over to the food court and pay 6 bucks for a quarter pounder \\\"without\\\" cheese ($7.50 with) at the mcdonalds and use the remaining 12 bucks getting wasted on the free drinks at the penny slots.",
