    "stars": "3",
    "date": "2016-11-22 00:00:00",
    "text": "Quite honestly the name and marketing are ploys. I came here specifically expecting craft beers and a lot of them, but the selection was smaller than my dreams and the ads set me up for. \\n\\nI love craft beer and I want to feel like I\\'m getting something special at a decent craft beer price and atmosphere. It\\'s a tad steep here. Totally a tourist trap as others suggested. Viva Las Vegas! That being said, the atmosphere is great and delivers. Wonderful view and arrangement and lots of tvs. \\n\\nOh, the beer isn\\'t bad. Mmmm. Very good actually. I found quite a few beers I thoroughly enjoyed and could probably find more, but maybe not at these prices. I felt bad for all the guys getting Budlights. But that was kind of confusing and entertaining anyway. \\n\\nI\\'ve come back because it\\'s a great place to take visiting and novice family and friends or a big and generous group to watch the game in style. Beers on tap, chile verde nachos and brats are totally our language and the other half of why I\\'d return. Great beer and food. \\n\\nSo I suggest to come here when in the mood to be touristy and splurge, because all women foodies get this urge, don\\'t we?",
