    "text": "Second favorite steakhouse in LV.  \\n\\nBest service and coolest staff all around.  Very attentive and accommodating.  Tuan the GM is the best!  This is why I have eaten here for 10+ years.  The best experience here was in the kitchen table a few years ago.  A must do at least once if you want to feel like a rockstar!  \\n\\nAll the steaks here excellent here along with the sides and truffle chips.  Too bad they stopped serving the chocolate souffle.",
