    "stars": "3",
    "date": "2014-09-02 00:00:00",
    "text": "I was looking forward to this meal for quite awhile.  My husband came here a few years ago and said it was his favourite!  \\n\\nI used OpenTable to make my reservation.  So convenient!  \\n\\nMost of our table had the signature tasting menu and two guests had the seasonal tasting menu.  If I had the option, I would\\'ve done some mixing and matching to get the best of both worlds.  \\n\\nThe first course of caviar was excellent.  I wished that was bigger.  I could easily have eaten a whole plate.  \\n\\nThe tuna tartare was a tad heavy on the sesame oil, but otherwise, the tuna itself was perfect.  I shared with my friend and got to try her hamachi.  That was incredible. \\n\\nMy miso glazed sea bass was amazing.  The texture was spot on.  The portion was just right and the flavours were well balanced.  \\n\\nWhat do you think of lobster pot pie?  Sounds like a good one, right?  The lobster was way overcooked.  It was actually a huge disappointment.  None of us wanted to say anything because we didn\\'t want another portion and we were getting full anyways, but this one was off the mark.  The carrots were undercooked.  Very strange dish.  \\n\\nThe wagyu steak was good.  Not fantastic, not terrible, just good.  The truffle was a nice addition but I felt the foie gras was unnecessary.  Of course, that might\\'ve been because we had just consumed the whole roasted foie gras served table side.  That was really good.  I preferred the middle pieces whereas some of our table enjoyed the end pieces.  Chacun son gout!  \\n\\nI liked the mini root beer float, but I\\'m a sucker for root beer.  The cookies were nice and moist.  The chocolate bar was very rich after such a filling meal, I wish I ate it all but just didn\\'t have room.  I tried my friend\\'s panna cotta and that was light and delicate.  Very smooth on the palate.  Passion fruit and avocado, go figure!  \\n\\nOverall, considering quality, quantity, and value, this was a good meal.  \\n\\nThe lobster threw me off (it threw us all off).",
