    "text": "I have driven by this restaurant hundreds of times since it\\'s very close to my house, and tonight I decided to stop in. I was very pleased to see they had Bulgogi on the menu. I ordered it along with a slice of carrot cake.\\n\\nThe Bulgogi was so tough it was almost impossible to eat. It came with rice which appeared to have been reheated several times, and a small ear of corn which was so waterlogged it was completely inedible.\\n\\nThe carrot cake was dry and appeared to be several days beyond the freshness expiration.\\n\\nOn the plus side, the place is cute and the people are very friendly. It\\'s possible their other dishes are delicious and I just ended up with really bad food tonight. But because it was as bad as it was, I will never give them another chance.",
