    "stars": "2",
    "date": "2011-09-05 00:00:00",
    "text": "This review is for the Blueberry Hill Restaurant located next to the library on Flamingo. A group of seven of us had just got done bowling at Sam\\'s Town and were looking to get our \\\"after drinking grub\\\" on. It was around 1am when we sat and began our wait....and I mean WAIT!!! We starting timing the waitress on our phones to see how long it was going to take her to get our order...10 minutes and a solid minute before we were going to leave. After that we waited another 10 minutes to actually get the drinks we ordered, well some of us that is. Me and two other friends ordered coffee and after waiting twenty minutes to see her start to walk over with it we all realized there was not enough in the pot for all of us. So my friend waited another 10 minutes before he actually got his coffee. My friend and I that did get coffee originally were already done with our coffee when he finally got some....uuggghhh!! Our friends that ordered soda both complained that something didn\\'t taste right and switched too water. AND that was just the drinks:( \\n\\nNow the food is the only part of this review that i gave stars to. Not for it\\'s promptness or fantastical value because it had neither but for the fact that it was hot and filled up my alcohol laden belly as wished. It was good....when we finally got it:( \\n\\nTo set things into perspective...when we got there another large group of six sat down at the same time as us. When we were sitting there wondering if we would ever get our food or coffee for the lone one of  us that still hadn\\'t gotten any they were gone and fed!!!! What a crappy experience at a normally very good place...disappointed that i brought my friends there for their first time and our waitress sucked!!! Must have had something to do with the 18% tip she tacked on our bill:{",
