    "stars": "4",
    "date": "2009-08-05 00:00:00",
    "text": "I\\'m struggling to figure out why I am rating this four stars instead of five. I guess that five stars is perfection and nothing is perfect, right? \\n\\nWe (me, wife, and my parents) at here on Sunday, August 2, at 7:00. We reserved via OpenTable and were promptly seated in a very nice location. Even though the restaurant was busy the tables on either side of us were kept empty until we were leaving, which was a very nice touch. My wife and I, and my parents, were celebrating our wedding anniversaries, and I noted this with OpenTable. This was communicated to the restaurant and they treated us very nice. \\n\\nThe service was extremely good. Each table is assigned three people: a head waiter, an assistant waiter, and a buser. All were very polite and professional. The buser was a bit green but that is OK; her mistakes were very minor. The head waiter was exceptional - I don\\'t remember his name and I feel bad for not being able to call him out and recognize him here. The second waiter was also very good; again, I forget her name. \\n\\nVery good bread was brought to the table and a complimentary appetizer was served to us that consisted of a very yummy chicken salad. My wife and I ordered the table-side Caesar salad and it was worth the $30. The table-side preparation is neat to watch, and she did a great job with it. The entire salad is made from scratch at the table. This Caesar goes right to the top of my list as my very favorite Caesar and almost makes up for the beat-down I got at the Palazzo\\'s craps table right before dinner. My dad ordered a shrimp cocktail that looked excellent. \\n\\nMy dad and I both had the boneless rib eye and my mom and wife split the filet. It was all good; in fact, I could have used a smaller steak. The waiter said it was 14-16 ounces but this was definitely bigger. For sides we ordered the asparagus, which I don\\'t eat, and the small potatoes with garlic, which were very good. \\n\\nI had a root beer float for dessert - I liked the fact that there were some old favorites on the dessert menu, including peach cobbler. \\n\\nWith two bottles of wine (at $65/bottle) we spent over $400 (before tip) on dinner but all agreed that it was money well spent. \\n\\nAbout the only negative is the couple who brought a very small child (6 months?) into the restaurant with them. The baby wasn\\'t doing well and cried somewhat - shame on the parents.",
