    "stars": "5",
    "date": "2010-03-23 00:00:00",
    "text": "Best meal I had in a LONG time.\\n\\nMy bf surprised me with reservations at Michael Mina to celebrate our engagement. I was amazed how nice the restaurant was and semi quiet especially since its located at the Bellagio Conservatory. You cant even hear the big crowds outside. I loved the ambiance of the restaurant. \\n\\nI decided on the Cookbook Tasting Menu and my BF got the Far Niente Menu (which changes seasonal).\\n\\nCookbook Tasting Menu ($108 per person):\\n\\n1. Tartare of Ahi Tuna - I love Ahi Tuna so I am biased but the tuna was really fresh and tasty.\\n\\n2. Mini Maine Lobster Pot Pie - MY FAVORITE. I wish I got the BIGGER lobster pot pie but its okay. The crust wasnt oily and there were plenty of potatoes and spinach. i would definitely order this again. \\n\\n3. Glazed Chilean Sea Bass with Shellfish dumpling - My least fav because I am not a fish person. The sea bass wasnt kinda salty but definitely loved the broth.  \\n\\n4. Loire American Kobe Ribeye with Foie Gras - Definitely a new taste for me. I enjoyed the Kobe ribeye and it was cook medium rare. It was my first time trying foie gras and its something i have to get use too. I really liked the potato cake though. YUM! \\n\\n5. Tasting dessert menu - Man, by the time dessert came i didnt even want to look at food. but i loved the root beer float and the warm chocolate cookies. \\n\\nI would definitely come here again. I am so glad my BF took me to Michael Mina. It was a perfect ending for our trip. I recommend ordering their tasting menus for first timers like myself because if i ever come back i am going to order from their entree or ala cart menu.",
