    "text": "We tried several items including appetizers and had mixed results.  Thought the seafood pasta dish was excellent with the right amount of zing to its tasty sauce and ample fish, shrimp, etc.  The sea bass on the other hand was a disaster.  It was very dry presumably because it was grossly overcooked, and lacked flavor.   Rib eye steak was tasty but a step down from a real quality steak house.  Tried some appetizers including the salmon cold dish, and was not at all impressed with the chefs attempt to turn the salmon into something special ( I consider myself a sushi connoisseur ).   Had a Mac n cheese side dish and was somewhat surprised to find small bits of pineapple floating throughout.  In my opinion the pineapple was not a pleasant surprise and simply detracted from a dish that I consider rich comfort food.  In retrospect I should have sent the sea bass back, but felt my doing so would impact our guests who were here from Korea.",
