    "text": "The steaks here are perfectly cooked! \\n\\nI topped by bone-in ribeye with a serving of seared foie gras. The meal was rich, decadent, and as everything I imagined it to be! I even split the steak and left very, very full. The foie gras reminded me of when I ate my way through eastern Europe 4 years ago. I\\'ve had a really tough time finding comparable seared foie gras State-side until I came here.\\n\\nAll of the sides were delicious. I think I had the creamed corn, spinach, and mushrooms.\\n\\nSkip the BBQ shrimp. It was a big disappointment coming from a man who prides himself in creole/cajun cooking.\\n\\nThe restaurant itself is really intimate. The ceilings are low and vaulted, so it\\'s like you\\'re in an underground church or something. My one gripe is that it\\'s a little noisy because of the set up. \\n\\nOf course, the service was wonderful, as expected. We were a group of 12 or so girls, there for a bachelorette party, and they handled us efficiently and graciously.\\n\\nIt\\'s a great place to go if you\\'re up on poker and want to splurge on a big slice of meat!",
