    "text": "Not toooooo shabby. But the only upsides i could give were the Shrimp Tempura crunch roll, and the tasty chicken Katsu. \\n\\nI walked in with my girlfriend around noon to have some AYCE goodness. 21.95 is a bit high, but a few dollars isn\\'t too big of a deal. But my experience wouldn\\'t bring me back. There were 2 or 3 other people in the restaurant, and while we were eating, a few groups came in, sat down and left without eating. I have no idea why.\\n\\nWe started off with miso soup. My girlfriend was fond of it, as for me it tasted a bit runny and a little on the downside of flavor, but it was the right temperature and it was just ok. The sushi was fair and like i said, the crunch roll was tasty and had to be the best roll that lunch. They do not have half orders, I prefer half orders because if there were to be a roll i did not like, there would be a small portion to finish, and also half orders get you to try all of the different kinds of sushi they have to offer. So this place is better for groups.\\n\\nService was definitely fast, the lady who served us was nice and friendly but she seemed rushed in a way that you would see as if you were late to class. I don\\'t like seeing someone in a hurry or having that panicking look.\\n\\nOverall just an A-OK Not really much to say about this place. I may come back with a bigger group or find a different AYCE sushi place.",
