    "text": "Tried this place out on a Tuesday night around 8pm because of the high Yelp reviews and it did not disappoint! I definitely recommend making reservations if you\\'re going around 7-9pm and want to sit in their cozy booths that make you feel like you\\'re inside a wooden barrel. They had a variety of choices on the menu to choose from. From sashimi, nigiri, sushi rolls, and cooked items. You can either do a la carte or pick from a 10 course dinner [$29.99] or 12 course dinner [$39.99] . As well as ayce for $80 which is steep or they had some other cheaper sets as well. The boyfriend and I chose to both do the 12 course. They bring out a piece of paper and for each course you get to choose which item you want from their list. I chose garlic edamame, hamachi w/jalape√±o, agedashi tofu, oysters [4 on the halfshell], soba salad with salmon skin [there were soba noodles in it! Pretty interesting], salmon bowl, tempura mix [shrimp and veggies], salmon teriyaki, sukiyaki [noodles, sliced beef, tofu, veggies in hot sweet broth], blue diamond roll, miso soup, and to finish off I had condensed milk shaved ice. I\\'d definitely recommend this place for someone who\\'s looking for something different. Only thing I\\'d change is the wait time on food.. After half way through we both got over waiting for another item to come but I see why they do that so you have time to enjoy your current dish. Everything was good and we definitely had stuff leftover to take home!",
