    "text": "Well I would love to tell you if the food was good or bad, but I did not get the chance.  I arrived at RE tapas at 9:00 on a friday.  The live music seemed to be good, but when I asked to be seated, the hostess told me that two cooks quit and it would be a 30 minute wait.  I think this is ridiculous when the restaurant was not that busy.  I then asked if we could sit down and have a few drinks before we ordered.  She looked around and said no.  This place will not be in business for long treating customers like this.  She told me the kitchen was backed up.  In these tough economic times, customer service should be priority one!!!!",
