    "user_id": "bLbSNkLggFnqwNNzzq-Ijw",
    "stars": "4",
    "date": "2015-12-02 00:00:00",
    "text": "Formerly a dismal-at-best fried rice counter, The Rice Shop is a serious upgrade and a welcome new business in this up-and-coming plaza! Rice bowls sound so simple, but they\\'re comforting, fresh, and hit just the right spot when done well.\\n\\nMenu has about five different bowls, each with their own protein and complementary sauces, all with rice and veggies. The Mochiko Chicken Bowl is the only one I\\'ve tried so far and it was great- generous portion of fresh, juicy chicken with a great sauce, crisp veggies, and a scoop of rice. So long as you go in knowing it\\'s mochiko influenced and not some strictly-authentic version of the dish, you should enjoy it. There are a few sides available, one being a salad with a choice of three house-made dressings (black sesame vin was my favorite.) \\n\\nOwner and Chef Tony is a treasure- I accidentally came just after close, but he opened up, let me in, and made my tasty dinner. He\\'s charming and chatty and has some great plans for this place. I\\'ll be coming back to try their Shrimp Bayou and porkbelly bowls soon!",
