    "text": "Fine dining is a great way to escape the bottomless Vegas buffets and Michael Mina is on the short list.\\n\\nWith a Michelin star, the food quality and service was what you would expect...very good. We had a show to catch so the waiter suggested we go with the faster pre-theater menu.\\n\\nPre-theater menu $68/per person + $35/per person wine pairing\\n\\nRecommended:\\n\\nAhi Tuna Tartare (add $15 to menu price) - they mix this table side and it\\'s a nice way to wet the appetite. The tuna is fresh and the tartare mix is light and refreshing.\\n\\nLobster Pot Pie (add $32 to menu price) - I debated whether to add this to the menu, but I\\'m a lobster fan. This was served table side as well and the pie crush is served beneath the lobster. It was hearty and the presentation unique.\\n\\nService - professional, friendly and timely\\n\\nThe only deduction is that the menu lacks creativity. I opted for the \\\"classic\\\" Michael Mina dishes...very good but not spectacular.",
