    "text": "Pho Bosa was closed (Wednesday) so I ended up here. This is another one of those moments....Thank. You. Yelp. App.\\n\\nThe place was easy to find, about a mile up the road from Bosa on Spring Mountain. I walked in and was seated quickly with a fine view of the large TV playing Fox News (?). Tick...tick..tick. No one came to take my order for what felt like 30 minutes, although I\\'d guess it was more like 10. I finally scooped up an order of rare steak and well done brisket pho along with an iced tea and an order of spring rolls ($12 total). \\n\\nAbout 5 min later, everything came out. Iced tea was standard. Spring roll was good and the pho....the ____ing pho....was phenomenal. The brisket wasn\\'t fatty, the rare beef didn\\'t taste like concrete and the broth was the best pho broth I\\'ve ever had. I was full early on and just kept having one more spoonful...then another...then another...then I was sweating...then I ate more...then there was none left...then I was sad. Compounding the sadness was the fact that no waiter had stopped by for another 10 minutes, so I had to stare into my empty bowl (the alternative of Fox News wasn\\'t any better). I eventually just got up and went to the register. \\n\\nI\\'m 4-starring this for now, but I have a feeling it will be bumped up to a 5 soon enough. Why? Only the finest in pho will get a 5-star rating from me and I have a lot more searching to do! Also, bleh to the service. Blehh.\\n\\nNote: the check-in offer of two egg rolls is not offered anymore :(",
