    "stars": "4",
    "date": "2011-09-05 00:00:00",
    "text": "My Husband took me here for our anniversary dinner. We arrived early at five because we had theatre tickets and had made dinner reservations accordingly.  The restaurant is beautiful with cream walls, rock wood and glass throughout with romantic lighting the evening was looking good. We ordered starters Crab Cakes for my husband nice crispy well seasoned crab I love a crab cake that is more crab then filler and this one was that. I ordered the steak tartar because I\\'ve never had it and wanted to be daring. I have to say I was scared lol but it was so worth it. Wonderful crisp toasted baguettes with rich beef capers oil and seasoning and spicy mustard sauce  this has got to be one of the best dishes I\\'ve ever eaten and a must try. We then followed this with Lobster bisque  rich warm and creamy with plenty of lobster one of my favorite lobsters bisques definitely.  I had the petite iceberg lettuce wedges a nice take on the classic salad with Wisconsin blue cheese buttermilk dressing homemade apple wood bacon and just the right amount of red onion really tangy. For our entr√©e we had chosen to go with the  Chateaubriand for two. They carve it tableside and serve it with asparagus and garlic potatoes The sides were actually very good but the meat was just ok nothing special and more red then I care for We had also ordered a side of saut√©ed garlic wild mushrooms which were also just ok I\\'ve had better versions of both these dishes. On to dessert we were bad and ordered two. The Chocolate root beer float which was not that great I guess we just didn\\'t care for the ginger and chocolate flavors together so we didn\\'t finish this one but the banana cream pie was like biting into heaven little shavings of chocolate rich sweet whipped cream bananas and sweet rich caramel sauce make up this dish and it\\'s worth every calorie that\\'s probably packed into it. So splurge and have it it\\'s amazing. The wait staff was amazing making sure you never wanted for anything and that everything went smoothly and the wine selection and service was top notch. Definitely worth the splurge",
