    "text": "After coming back from Thailand I have a new application for Le Thai. I am yet to eat here since I\\'ve been back (I\\'ve definitely had my fill for a while), but I\\'m already looking forward to it.\\n\\nMaybe I just didn\\'t have the greatest experiences in Thailand, or maybe thai food in Thailand just is what it is. \\n\\nI will tell you though Le thai was one of the reasons why I was excited for thai food in Thailand, and yet nothing compared. \\n\\nThe Pad Se Ewu, Awesome Flat noodle, and Shrimp Stir Fry are among my favorite dishes here. \\n\\nIf you want to try something different and hearty, opt for the Tri Colored Shrimp Noodle Curry. Usually on the special board, but if not they can usually make it. It\\'s like the Thai version of Shrimp Alfredo! Without shrimp would be like Thai Vegan Alfredo!",
