    "text": "i believe 3 stars is fair; let me tell you that I\\'m very fair about what I say based on experience and what I know. To start i really like the place, small enough to sit comfortably watch some filipino shows and really be in the feel of vegas. But what I don\\'t understand is how filipino food specifically restaurants have not raised to the top with our variety of taste and textures we should be at the top of the foodie charts.  When you serve your clients the basic staple of our country ( rice) please make sure its fresh. To serve me Garlic fried rice with the garlic purple in color this tells me that the rice has been sitting, re heated, re fried several times over that the garlic actually changes colors. This is a fact-\\n\\nRice to me is essential in this situation- Its really easy to cook and it can make or break you as a business. sounds funny, I know but to foodies like me its the details that matter. to some i might sound harsh or out pocket with my reviews. But like any consumer we want the best money can buy, in this case, basic filipino breakfast.\\n\\nperhaps next time I visit the experience will be different. but for now, until then. my ratings stand at 3 stars.",
