    "date": "2011-06-08 00:00:00",
    "text": "This place lives up to its high reviews. Everything was fresh, fragrant and flavorful. Probably some of the best fried spring rolls I\\'ve had. We asked the waiter what the most popular appetizer was, and he promptly replied, \\\"We have the best egg rolls in town!\\\" He didn\\'t lie.\\n\\nI had the beef stew with french bread - really nice portions and presentation, and the bread was perfect, having the nice consistency with soft, semi-chewy inside and thin crispy outside (but not super flaky). Not even the slightest hint of stale-ness in the bread like most places give you. I\\'ve grown up with great tasting Vietnamese food all my life and both of my parents are chefs - and this place did not disappoint. That\\'s saying a lot! :)\\n\\nMy boyfriend got the combination pho - nothing to complain about and everything to praise. I seriously can\\'t find any faults with this place. The place was very clean and well stocked with condiments. The service was quick and friendly. \\n\\nIf I lived here in Vegas, this place would definitely be a frequent spot to eat for me. With flavors and prices spot on, I\\'d recommend this place to anyone craving and looking to try Vietnamese cuisine.",
