    "text": "bleh.\\nWhat the heck was I thinking?! There is a Michael Mina in SF which I hear is better than the one in Vegas yet the one weekend I\\'m in Vegas, I decided to go to Michael Mina instead of trying somewhere new! =T\\n\\nIn any case, the bf and I went. We decided to try one of his Signature Trios so, we went with the classic pork. The pork is prepared in three ways; 1.kurobuta 2.pork belly with marmalade 3. BBQ pork worchestershire. The presenation was nice, however, the taste was not. Kurobuta is naturally fatty and tender. I have never met a dish of kurobuta that I could not finish. Mina certainly changed that for me. It was chewy and extremely tough. It\\'s a shame. 2 & 3 arent even worth mentioning. We couldnt finished our trio. Such a waste.\\n \\nOn a more positive note, the following dishes were memorable:\\n1. the butter poached lobster. the foam was a nice touch, it added a bit of lightness to the dish.\\n2.the lobster pot pie. Thin on the dough and cream - its a good thing. it allows the lobster to stand out and not be overshadowed by the sides.\\n3.Foie gras medallion over the american styled kobe. Foie gras was sweet and the meat was juicy.\\n\\nIs it me or is Mina becoming a little too commercial and completely over rated? Not worth the pricetag...dont fall into the hype.",
