    "text": "Whenever we go to Vegas, we do our best to get dinner here. It\\'s a feast for the senses. Be sure to pace yourself because all of the dishes are incredible! My favorite is the shrimp. This place is great for get together with big groups of people. I\\'d highly recommend it!",
