    "text": "My husband and I came here for lunch and were seated right away at the bar area. The restaurant itself looked very nice. Open kitchen where you can see the chef prepare your meal. They decorated the place with noodle bowls which added a nice touch. Now moving on to the food... We ordered spicy beef brisket noodle and tonkatsu ramen.  At a noodle house the broth makes or breaks the soup. The broth of the tonkatsu ramen was bland. We had to add soy sauce and other spices to make it decent. It certainly was not a $12 ramen. The spicy beef noodle was alright although the choice of using udon for this type of soup was off. In the span of time that we were having lunch three customers complained about their food. One soup got sent back because it was served lukewarm. A couple ordered fried egg rolls and they sent back the lettuce that they serve it with as it was dirty! And we complained about the lack of flavor of the soup which the chef just shrugged off saying it tastes fine to him! Needless to say, we are never going back.",
