    "text": "I am writing this message in regards to the terrible service that my party of two encountered on April 1st at your Windmill and Bermuda location. I understand that the location has now merged with Shoku Ramen-ya and the servers might not have adjusted to the ramen menu or may not be as knowledgable about it. I myself am not a true ramen connoisseur, but I know what I like and what to order. My friend and I both ordered a bowl of ramen; I ordered tantanmen and my friend ordered the spicy miso ramen. Our waitress Annette put in our orders. About 15 minutes later another waitress dropped off our ramen, rushingly saying \\\"who had the tantanmen\\\". I slightly raised my hand and she placed the bowl in front of me. She then assumed my friends bowl was in her hand and rushingly said \\\"this is tonkatsu\\\" and rushed away from our table. My friend asked what she said and I thought I misheard her but I knew tonkatsu did not sound anything like spicy miso. We knew, however, that it was not her bowl because it contained egg, broth that did not look spicy at all, and other ingredients that were not supposed to be in the spicy miso ramen. We then asked a male waiter who told us what they were but he was quickly brushed off by our waitress Annette who said \\\"oh these bowls are correct but you guys just have each other\\'s bowls\\\". She then switched our bowls and left us confused. I then went on yelp to look at the pictures of the ramen dishes we ordered while my friend dived into the dish in front of her. I found a pic of my dish which was now the dish with the egg and unknown ingredients, it looked nothing like the tantanmen dishes that people posted pictures of. We then called the waitress Annette over and she said \\\"these bowls are correct, this is what you ordered\\\" so we asked for a menu and she showed us on the menu what we ordered. Our ingredients did not match the ingredients on the menu! But she insisted they did and we said the spicy miso isn\\'t even spicy. \\\"She then said it\\'s not supposed to be very spicy. Then we asked why does it have extra ingredients in it. So she said well the chefs must\\'ve just added extra products and that it would only cost US a couple more dollars, as she laughed it off. At this point she started blaming us for the switch and tried to give me back the tantanmen that my friend, who was starving, had already eaten quite a bit out of. She kept saying \\\"well you guys were confused but it is correct so you can switch up the bowls again, this is in fact what you ordered\\\". We KNEW what we ordered and this was not it. We asked to speak to a manager. The manager came to our table and said \\\"so I heard that there was a mix up between you two but it is now resolved\\\". We told her it was not resolved and we explained to her what happened. She then suggested that her waitress and staff were correct and that we should just switch the bowls back. She then lifted the bowl that my friend had been eating out of and tried giving it back to me. How unprofessional to assume that I want to eat out of a bowl that\\'s already been eaten out of and pay full price for it. I stopped her before she placed it down in front of me and we asked for different bowls. She then said \\\"let me talk to my cooks and see if there was in fact a mix up\\\". She finally came back to our table and said \\\"oh, there was a mix up actually because another table ordered almost the same ramen as you, and you two got their orders\\\" she then agreed to give us new ramen bowls. Then our waitress came back and said \\\"I am sorry that you were confused and I will take off one of the ramens for you, is there anything else I can get for you?\\\" We said no, we just want our ramen so that\\'s it. They brought us the correct ramen and the check. The check did not comp us like Annette said it would. I then asked what happened to the comped bowl and she said \\\"oh no actually you are going to be paying full price for what YOU ordered\\\". We were then so frustrated that we paid and left. I am very disappointed in the service and especially with Annette and the manager! They blamed us for their mistakes and it is not acceptable",
