    "text": "My family went here for dinner before going back to our hotel/casino to gamble. We wanted pho, and Kinh Do was the closest place in the Old Vegas area.\\n\\n-- VENUE --\\nThe place looks like most Vietnamese pho restaurants: lots of tables, Asian portraits on the wall, lucky bamboo decorating the restaurant, with a clean bathroom. Typical expectations.\\n\\n-- PHO --\\nI\\'ve eaten pho most of my life and can tell what\\'s good and bad at this point. If they get the base broth right, there\\'s hardly a need to add additional sauces and enhancements to it. The pho here had a good base, and I barely added any other sauces to it. I ordered a large and ate every noodle.\\n\\n-- SUMMARY --\\nI give the pho four stars. The service was sufficient; the staff was friendly enough and they refilled water as necessary. It was a nice casual night out with tasty pho and spending quality time with my family away from home. Recommended.",
