    "text": "I love eating buffets in Vegas and this was the worst I\\'ve had.  We had just checked in to our hotel and we were hungry so this was the closest buffet.  It was mid-afternoon and there was no wait.  The place is clean and the service is good but the selection and quality of food needs improvement.  I wasn\\'t the only person walking around with empty plates looking for something to fill it with.  Maybe there wasn\\'t much food because it was lunch.  Perhaps their dinner selection is better but I don\\'t think I\\'ll return to this buffet.\\n\\nNot worth the money.",
