    "text": "Arrived here with my girlfriend during a quick vacation stop in Las Vegas. Was craving ramen and there weren\\'t many options based on the location.\\n\\nBut this ramen was amazing! It met all of our needs.\\n\\nIf you go, you must try the Spicy Miso Ramen. We shared that one and it was incredible.\\n\\nOther than that, the customer service seemed to be great/friendly and the atmosphere/decoration was traditional and nice.\\n\\nThere wasn\\'t just ramen on the menu and I\\'m sure the other stuff was great too. So whether you\\'re craving ramen or not, you really cant go wrong with this place! Would highly recommend.",
