    "stars": "3",
    "date": "2009-01-08 00:00:00",
    "text": "After a canceled flight, I wound up spending my airline meal vouchers here for dinner and a breakfast. The prices for dinner change daily, depending on the night\\'s theme cuisine. My night was BBQ and it cost about $15.\\n\\nLike a lot of sub $20 buffets, the food offerings here need to be attacked with a strategy in mind. I have my own system for deciding what to pick, but the most important buffet rule is to immediately stop eating anything that isn\\'t GOOD. There\\'s a lot of crap at this buffet and a lot of stuff that\\'s so-so, but there\\'s some real good stuff to be eaten, as long as you\\'re not busy chowing down on dried-out, fake, instant, imitation, bland funk.\\n\\nI found the roasted chicken to be excellent, like actually worthy of being on a plate being served in a regular restaurant. The crawdads were unique and it was my first time trying them. I didn\\'t care for the taste, but I don\\'t have anything to compare them to, so I switched over to the peel and eat shrimp. The salad bar was decent enough. The bread pudding was amazingly good. The service sucked, as my water was never refilled, I had to scrounge for a second napkin, and at one point my table was totally cleared while I was up getting more food.\\n\\nBreakfast was about $8. The OJ was fake and tasted funny. The coffee was not bad, but not good. Skip scrambled eggs as they\\'re fake too. Instead, get your eggs off the top off the Benedict offerings. You don\\'t want to eat the whole Benedict, just the egg, as the rest is gross. I have a weakness for cheap-o breakfast sausage with syrup on top and I wasn\\'t disappointed. Don\\'t bother hoping for a nice pastry to pair with your last cup of coffee because they\\'re all pretty horrible.\\n\\nOverall, FMB is worth the price it seems, but don\\'t think you\\'re going to get the variety of a full buffet, as most of the food is no good. Be picky and search out the few gems to be found, then jump in with both feet.",
