    "text": "I really wanted to love this - I had very high expectations going in...unfortunatly, well, maybe I caught them on an off night..\\n\\nLet\\'s start with the wine list - the night in question they were out of the slightly over $100 (inexpensive for the restaurant) bottle of Cab that I selected,  Not really a problem - found one that cost just a little more.  However, later in the meal one of the waiters informed me of another Cab (not on the list) that cost about the same as the one I originally selected but was much better than the one I ended up with. Why not inform me of this BEFORE I selected another bottle?  Strike one.\\n\\nIt was a Sunday night and I was informed that they were out of the special of the day - some sort of fish. Again not a problem as we came in for BEEF.  Just thought I would mention it...\\n\\nThe wedge salad - the bacon bits served with it were cold, greasy, and very tough.  Not good. The salad itself was fine - good blue cheese and nice and crisp- but for what you are paying the bacon should have been as well. Strike two.\\n\\nNow on to the steak.- the \\\"signature\\\" bone in rib eye. It was good. Very good in fact. - a huge cut cook just as I orded. But...it was kind of bland. Not totally lacking in flavor but still kind of bland.  Not bad, but not the best steak I had ever eaten.  My friend\\'s filet was also very good - an excellent cut cooked as ordered but still a bit - shall we say?- unseasoned?  Call this half a strike.\\n\\nNow on to the pecan pie and ice cream thingy - yummy. Best part of the meal!\\n\\nAll in all, Emeril\\'s Delmonico is not bad.  Just that I was expecting more...",
