    "date": "2013-11-15 00:00:00",
    "text": "I never wanted to find the best pho in Las Vegas. Well, I would in an ideal world, but after being burned so many times, I just wanted one place that measures up to my Californian standards. I think my quest is finally over after lunch yesterday.\\n\\nAll you really need is a hot flavorful broth, lots of delicious meat, reasonable noodles, and some thai basil and lime on the side. The pho dac biet (#5 [EDIT: appetizers are #1-#4] on the menu) came out very quickly after I placed the order (not a busy lunch hour). It satisfied my palate entirely, and it was very filling, about the same as a typical large pho somewhere else (there\\'s only one size here) and very much worth the $7.49.\\n\\nI also ended up with two cha gio (egg rolls) from the free Yelp check-in offer. They were very crunchy and filled with pork, carrots, and mushrooms the way I\\'m used to having them, which is not the same as your typical Chinese egg roll with lettuce and whatever mush is in the filling. A quick wrap in lettuce and a dunk in nuoc mam was all I needed for a nice appetizer.\\n\\nPho Kim Long, Lemongrass Cafe, and Da Lat all failed the test, but Kinh Do has passed with flying colors. Other than the Mexican server, they\\'d fit perfectly in San Jose. Actually, given the demographic trends, I guess they\\'d still fit.",
