    "text": "MM was an excellent choice before the Cirque \\\"O\\\" show.  We reserved a table for the 5:30 show seating.  The 5:30 and 6:00 seating offers an additional price fixe menu.  The special menu was $55pp and included appetizer, main course and dessert.  The restaurant was empty except for a few tables (Sunday night) but filled up before we left.\\n\\nWe opted for the wine pairing with our meal.  This was an additional $55 total (1 glass per person, per course).  The wine pairing was very good.  \\n\\nTuna tartare and salad were both excellent.  Miso cod and filet were also great.  Filet was not cooked medium (it was medium well) as requested but still had great flavor (so we did not send it back).  Chocolate cake dessert was very flavorful.\\n\\nOverall a great dining experience.  Service was outstanding.  Recommended.  4.75 stars...minus .25 for the steak being medium well. \\n\\nP.S. Drinks at Sensi beforehand are a great choice.  Friendly bartenders and creative cocktails featuring fresh fruit.",
