    "stars": "3",
    "date": "2010-12-11 00:00:00",
    "text": "Just had Ethiopian food for the first time.  It\\'s overall a good experience.  I thought it\\'d be a hole in the wall place but it\\'s actually very nice inside.  The wall painting and the music create a nice relaxing island ambience.\\n\\n  I\\'m still not too used to eating with my hands because sometimes I like a spoonful of yumminess.  My favorite was the chicken and lamb dishes.  The chicken was cooked in tomato based spicy sauce.  The lamb was cooked well with onion and jalape√±o.  I didn\\'t care much for their veggie platter.  The red and yellow colored been pastes didn\\'t sit well with my taste buds.  The spinach, cabbage and a couple of other veggies were ok but nothing special.  I\\'d order more meat dishes if I go there again.  I also saw some beef dish on sizzling plates going to other tables looked very good.  The service was decent.",
