    "text": "Ate there last night with a friend as we was attending a concert at the Arena, the restaurants seemed pricey and we wanted some options.  So we hoofed it all the way to the opposite end and was shocked that it was $39.99 per person.  By that point, we were kind of stuck so we paid it.  But the food was very good with lots of choices.  The carving station had 3 different types of beef which is unusual, along with turkey and kielbasa.  The carver didn\\'t seem to understand English well, those of us getting meat had to point to what we wanted.  There were self-serve beverage stations on each end of the room, along with a small bar.  I had a glass of wine, which was okay and only cost $6.00.  Overall, it was a decent buffet, just overpriced but then, many of them are now.  The Strip in general hikes the prices up for the tourists, forgetting that many locals would go there more if it was reasonable.",
