    "stars": "4",
    "date": "2017-01-15 00:00:00",
    "text": "Made a quick stop on our way back to Cali from Vegas. This place is tiny and narrow and when we got there, it was not even busy. After ordering and waiting, a ton of ppl from nowhere came in and the place was jam packed.  \\n\\nWe ordered the following:\\n01.  Mango Green Tea - $3.66 - 3 Stars\\n- Green Tea was bitter and dark, Mango syrup was a bit too sweet. It was just okay.\\n\\n02.  House Milk Tea w/ Honey Boba - $3.66 + .50 Boba = $4.16 - 4 Stars\\n- Smooth milk tea w/ Honey Boba.  I\\'m not a fan of Honey Bobas at all but the kids loved it.\\n\\n03.  Okinawa Milk Tea - $3.66 - 4 Stars\\n- Smooth and Creamy but we\\'ve had better in Cali. The portion of sweetness and tea was perfect. Do recommend always ordering \\\"Okinawa Mik\\\" if it is offered.\\n\\n04.  Passion Fruit Black Tea w/ Honey Boba - $3.66 + .50 Boba = $4.16 - 3 Stars\\n- Good Passion Fruit flavor, not too bitter or sweet.\\n\\n05.  Oolong Milk Tea w/ Boba  - $3.66 + .50 Boba = $4.16 - 4 Stars\\n- Oolong tea is a better option if you\\'re not into the dark or bitter teas. Tastes lighter and are smooth with Milk Teas. \\n\\nLOCATION - In a tiny shopping plaza, tiny internal space. Depending on where you are on the street you have to make a U-turn to see it. \\n\\nCUSTOMER SERVICE - Not the FRIENDLIEST or the FASTEST, but I\\'m used to Cali Tea Houses where the volumes of people are much higher.  We waited 20 minutes for our 5 drinks. Prices are decent for the cup size you get. It\\'s the same price for the regular or large so why not just get the larger one right. The definitely can improve on the speed of getting the tea orders. \\n\\nGOOD THINGS - They have a Stamp Card for frequent buyers so you can get free drinks. Pick one up if you are from Vegas.  \\n\\nVERDICT - Good teas for Vegas but we have so many amazing one in Cali that Cali Tea Houses are still my FAVE ones.  But when I\\'m in Vegas next, I\\'ll stop by to get my stamp card punched.",
