    "text": "Warning!!! Do not go to this steak house and order seafood. I had a craving for some oysters so after the waiter recommendation I ordered the seafood platter for 2 and expected nice big plump oysters, shrimp, king crab, and lobster but instead got the total opposite. For the high price they charge we got small portions where the oysters were the size of a half dollar with barely any meat and the so called jumbo shrimp was medium size that was literally the same size as the lobster and the king crab leg was so skinny it looked like it was from somebodies leftovers (See photos).\\nThe popover bread that came out was huge which gave me the  impression that the entree and sides will be the same. I ordered the veal chop, while the wife had the main lobster, the kids shared the braised short ribs and our friend had a steak. The waiter told us that the sides were big enough to share so we ordered mash potatoes, asparagus and wild mushrooms. When the food came out the veal chop and braised rib looked and tasted good but the lobster again was tiny along with the sides. The portion of the mash potato was a joke - 2 spoons and it was gone; how can that be enough for even one person let alone sharing.  Same for the asparagus and mushrooms.\\nSpending over $400 plus tip we left feeling unfulfilled and hungry.",
