    "text": "When I think back to my experience @ Michael Mina all I can remember is how BORING this restaurant was. I understand that this is meant to be an upscale  and refined place, but it is in the heart of Las Vegas for pete\\'s sake! Don\\'t get me wrong, I\\'m not suggesting to have Motely Crue blaring in the background, but step up the decor at least!\\n\\nAmbiance -BORING \\nServers - BORING \\nMenu - BORING \\n\\nRegardless of how the food tasted, I have no desire to dine there ever again because it was just such a dry atmosphere. Bland white walls, bland white table cloths, smooth jazz (aka elevator music) playing in the background. BLAH! It was much too stuffy in there! \\n\\nFor the record, the food was very well prepared but the pricing on the main courses seemed a little ridiculous. It\\'s the type of place where you pay a lot of money for barely there portions. Don\\'t bring your appetite to this spot!",
