    "text": "This was the place we had my brother birthday dinner.  We were told it was lady\\'s night on Thursday at the chocolate Lounge, which was find but didn\\'t realize we could here anything but the music.  We had 15 people with us so most conversation was through text lol.  Very cute place.  \\n\\nReason for getting a one star was the service.  Knowing the music was so loud why would you try to talk to me from across the table.  After ordering our food it had taken a good 35-40 for appetizers.  It wasn\\'t busy.  Even for a house salad!  Come on now.  Everyone food didn\\'t come out at the same time.  3 hours later and 20 minutes for the bill.  I was over it not worth $761.  We all wanted desserts but didn\\'t want to wait another hour.  \\n\\nMaking the reservations was hard enough to get through.  With one person telling me I had to go through a group with a set menu.  And another telling me we didn\\'t.  Where is the communication?  For being on the Las Vegas strip you would think service would be on point.",
