    "text": "This place is honestly one of my favorite places now. \\n\\nI highly recommend the Okinawa specialty milk tea with boba! Their Okinawa ice coffee is delicious as well.\\n\\nHeads up they also sell hot pot and brick toast. In case you may wonder, brick toast and honey toast are two different things. Brick honey toast is just the slice of bread versus the whole loaf of bread in a honey toast. Seats here are sparse ( still more seats than Kung fu tea thank goodness!) \\n\\nIt gets a bit busier at night and there\\'s hardly parking out in the lot so be aware as I\\'ve been here at 10 and they\\'ve run out of boba before...horrific I know! Also make sure to get a punch card. \\n\\nTheir \\\"normal\\\" size is pretty big AND they have light bulb cups for an additional 99 cents now!!!!!! So cute!",
