    "stars": "5",
    "date": "2008-05-12 00:00:00",
    "text": "Having concurrent sex with Eva Mendez, Charlize Theron, Kate Beckinsdale, and Jessica Alba..... if they came in the form of Tapas dishes for your dining pleasure. I mean that this is not your traditional Spanish Tapas restaurant, as they do have some novel creations by the executive chef/owner, such as this phenom sashimi dish, but that doesn\\'t take away from the fact that I have now found my favorite Tapas restaurant in the US. The food was delectable, and well worth the 8 minute drive out of the strip. I believe the owner said the restaurant has been open for just a few months... and boy what a welcomed addition to the epicurean elite!\\n\\nMy group had at least 15 different dishes served all night, and as full as I was... I just could not stop eating. The lamb chops, super tender calamari, scrumptious lobster n\\' crab, the carpaccio, Tortilla Espanol (which even our Basque friend said was spectacular), and this amazing grilled romaine dish (yes... I said Romaine lettuce... NOT what you expect and a MUST ORDER!!)...... my mouth is watering just thinking about it... all the way to dessert (you MUST try the truffles with lychee vodka). The only thing I did not enjoy was the ceviche.... but that was probably because I just don\\'t like ceviche in general, so I can\\'t be relied upon for comparison on this.\\n\\nIn Las Vegas, this is only the 2nd restaurant in my 20 years of coming regularly that I\\'ve dined in that is on my MUST DINE list on each and every subsequent visit to Sin City (the other being Kraftsteak in MGM... their Platinum cut Kobe steak....!!!). Firefly is good.... but this place..... a class in and of itself. \\n\\nOh... and VALUE!!!!! Price AND quality? Huge fan here..... and I hope they don\\'t change a thing.",
    "useful": "4",
    "funny": "2",
    "cool": "3"
