    "text": "I\\'ve celebrated many birthdays (mine and family members\\') here and I\\'ve never had a bad experience with the food or service.  Good food (6-course meal for a reasonable price) and belly dancing, what more could you ask for?\\n\\nI love the interior - it\\'s like you\\'re in a tent.  So cozy.  Your dinner starts by washing your hands in fragrant rose water.  From the prix fixe menu you get shrimp scampi with bread, harira soup (lentil), hummus with veggies and olives, beef kabobs,  cornish hen with couscous and b\\'stilla with mint tea.\\n\\nThey have about 3 belly dancers per night.  The best one is the brunette with long wavy hair (Aradia is her name) - she\\'s the one on their business card and she can do things with her belly I did not imagine could be possible!  She can make beads hanging from her outfit on her upper stomach shake/vibrate.  And I\\'m like, \\\"how\\'d you do that???\\\"\\n\\nI recommend making reservations as they tend to get pretty busy especially on weekends.  Be prepared to belly dance.  If you\\'re really tall, your back and knees might hurt as seats are pretty low.  Get ready for a fun night!",
