    "text": "Our first encounter with Smashburger was for a friend\\'s birthday party. At the time, my son had yet to outgrow his milk protein and soy protein intolerance/allergy. Which makes eating out something of a challenge for us. Fortunately, Smashburger has an extensive and informative food allergy menu/guide on their website, and the create your own option allows me to easily get a burger free of allergens to share with my son. \\n\\nThe food here is really good too. We love their burgers, and the Smash fries. I was sad to learn though that it\\'s not just seasonings and olive oil on the fries though. Their website indicates that there is soy in the seasoning, and my son did have a slight reaction after eating them.",
