    "date": "2012-05-13 00:00:00",
    "text": "First review for this place...uh oh. One positive: they have good pickles. First of all, the prices are waaaaay high for what you get and the quality. We pulled up to the drive thru (only 1 car parked outside, dining in) and no one in the drive thru. We were asked to \\\"hold on a sec\\\" - after about 3min my husband said \\\"hello?\\\" and we were asked to \\\"hold on a sec\\\" again...after 5 min we were asked if we were ready to order...ummm, yeah. We order and pulled ahead where the girl at the window stuck her hand out for the money, no hello, no nothin\\'. She gave us the change and said sorry for the wait, it will be a bit for your food. So we waited, and waited and watched a table of 4 inside wait and wait and then get their food. Then, we watched them eat. Ok...started to get annoying at this point, yes I could see them cooking the burgers on a grill so they are freshly cooked but come on! At last...22 min after pulling up to the menu board, we receive our food, where she once again says \\\"sorry for the wait\\\". We drive home (3min away). And unveil....well take a look at the photos I posted. Yikes! My husband\\'s burger Camaro Cheeseburger (2 patties) $5.49 he got with ketchup, mayo, tomato, lettuce was alright, just alright but super sloppy! (You have the option to order mustard, ketchup, mayo, lettuce, tomato, pickle, onion & grilled onion, all free). My burger, the Mustang cheese burger $3.99 (single patty) with ketchup, mayo, pickle, & tomato was bleck. Totally overcooked and black. I even got free black \\\"crunchies\\\" in wrapped up with my burger - see photo. Totally sloppy! We got a chili dog to share/try instead of fries, cause we thought maybe it will be good and wanted to know in case we come back (which won\\'t be happening) since it was they same price to order plain ole\\' fries. It was slopped all over the paper, hardly any chili, little squirt of liquid cheese, and what there was of it was all over the paper, again see photo! It was alright, not good, alright. I cannot, I repeat, cannot believe it is $3.29 for this!!!! It is small, the same dog as weinerschnitzel for $.99 Cents!!! Total for our order: $13.80. Price it was worth: $7.50.\\n I am sad, I really was hoping for something good here that we would go back to since it is close to us. Oh well. I definitely do not see this places hanging around for long. Sorry to the people who were behind us in the drive thru....hope you aren\\'t still there waiting for your order.",
