    "text": "Nestled in shopping plaza that\\'s been thru various failed businesses is a Filipino restaurant called Full House BBQ. First thought when passing by, I thought the business was closed, or was still in renovation. I always judge a place based on the smell of the food cooking. First thing I smelled was adobo and lechon. From there I had high expectations, well of course putting into consideration of fellow yelpers.\\nI had ordered the palabok. The first thing I noticed was that it was tasting burnt. Seems like they left the sauce in the saucepan too long. The noodles and meat were fine but the sauce had a burnt taste that overcame the dish.\\nBut after a disappointing start, the main dish came out. I ordered the pork sisig. Meat was carefully marinated and the green onions and sauce was a great medley. Even tho their palabok was not to die for, their pork sisig made up for it very much. Next time if I do come back to this place I would just get a Pork Sisig to go.",
