    "stars": "3",
    "date": "2017-02-12 00:00:00",
    "text": "Located inside my favorite hotel Venetian, Delmonico is one of Emeril\\'s restaurant. When you walk in, the decor is very minimal but sophisticated with arched ceilings that makes you feel like you\\'re inside a European gallery. \\n\\nWe ordered the following:\\n-Deviled eggs: delicious! Very creamy, topped with King Crab meat is a plus.\\n-truffle potato chips: good sharable appetizer. \\n-New Orleans style barbecue shrimp: if you\\'re into Cajun style barbecue shrimp, definitely order this dish. A bit different from the ones we had in New Orleans but still good. \\n-Lobster bisque: has good amount of chunky Lobster meat, but not the best I\\'ve had. \\n-ribeye: due to pregnancy, I had to order a well done steak. My steak came close to medium well, pink in the inside. I sent the steak back, it came back still not completely well done. Sent it back for the second time and the steak came back as beef jerky.. I expected at least the second time around for them to make a new one as I know the effect of cooking a piece of steak multiple times. Of course I wasn\\'t expecting a well done steak to be juicy and tender but I have had a properly cooked well done steak before that\\'s was not super tough! Flavor on the steak was pretty good, but could not taste the dry aged flavor as much. In the end, the restaurant took this off the bill, which was a nice gesture. \\n-sides: Creamy corn (very good), mushrooms (a bit salty but good flavor), twice baked potatoes (good). \\n\\nOverall, I would give this restaurant 3 and a half stars.",
