    "text": "I love Michael Mina. For those who have been, Saltwater in MGM Grand Detroit was amazing. Unfortunately, it closed but let me tell you that it lives on at Michael Mina in Vegas. Unfortunately, I am not knowledgable about which restaurant came first but I would say I have found my favorite fine dining chef. We got the tasting menu and it was orgasmic. It has everything I love in fine dining: caviar, tuna tartare, chilean sea bass, lobster pot pie, ribeye, and dessert. The service was great and everyone was very nice.",
