    "text": "Update 9/9/17\\nThey have vegetarian pho now! It is SO delicious. They even give you the option of beef broth or veggie broth. The veggie broth is so tasty.. 5 stars!\\n\\n\\n--------------\\n\\n\\n\\nThe customer service here is amazing. Our server accommodated to all of my party\\'s needs, whether it was to personalize an order or to split checks. I loved how he always said \\\"you got it\\\" in response to our request. \\nOn top of the great service, the Thai iced tea here is delicious! It\\'s not too strong, too sweet or too creamy. It was just right on this hot summers night. \\nI am vegetarian and could not find any veggie pho. However, our server happily agreed to my request of pho with veggies.\\n\\nAdditionally (seriously, the positive things just don\\'t end), my party of 10 people stayed 30 minutes after the restaurant closed to finish our food. Even though it was after hours, when my boyfriend asked for a banh mi sandwich to go, they did not turn us down even when the kitchen is supposed to be closed.\\n\\nBTW: make sure you check in on Yelp when you eat here! You get free egg rolls :)\\n\\nI really wish there was a pho place like this back in California with such great service.",
