    "text": "I\\'m from LA and I\\'m half Vietnamese, so I know good Vietnamese food. I usually go to Pho Kim Long on Spring Mountain for my Vegas Pho fix but checked out Kinh Do because it was highly rated on Yelp.\\n\\nThe service was very friendly, attentive, and fast. The restaurant was very clean. The food was authentic. I had the satay hu tieu ($7.99), which was flavorful and spicy. Other people in my group had pho and bun Bo hue. I thought it was pretty good and tasty for Vegas Vietnamese food. My only critique was that there wasn\\'t much meat. The noodle to meat ratio was very high, but prices were reasonable. I would recommend it and come back.",
