    "text": "We came here because of a Yelp suggestion when I was looking for a special bday place for under $100 for two. \\n\\nWhen I first walked in, I was disappointed. I expected quiet and romantic and it was loud and a bit boisterous. But our seats were cozy and close, so it made conversation easy. Once my expectations readjusted, I had a great time.\\n\\nThe music could be a little lower in volume when the dancers come out, and it could be even lower still in between dancers. But the cozy seating and the method of eating made it all cozy anyway. And...the music was mostly quite awesome!\\n\\nThe scampi was scrumptious, though though would have been completely stellar with a bit less salt. My bf\\'s vegetarian version with mushrooms was a neat idea and worked well.\\n\\nThe lentil soup was some of the best I ever had! In fact, all of the food was really good. \\n\\nThis was a fun night and though I wouldn\\'t eat there all the time, this is definitely  a place to take a group. Aside from the bellydancing, the presentation of the food, hand washing, tea pouring, are all flashy, showy and FUN! \\n\\nDo it!",
