    "text": "Eek! Methinks not was exactly what I was thinking when walking around the buffet area. My boyfriend has been staying at the Las Vegas Hotel for our budget trips and the casino gave us two complimentary buffet passes for dinner. They were FREE buffet passes, but I am still giving it one star. The regular price for dinner was around $21.00 per person and that is definitely NOT worth the price for this buffet.\\n\\nFood: \\nOrange Chicken: Their orange chicken is pretty much microwaved chicken nuggets with an orange syrup sauce. If I had the palette of a three year old, I would have maybe enjoyed this.\\nChow Mein: It was a joke. There was chow mein all over the floor and counter. \\nCarne Asada Meat: Dry and no flavor.\\nSteamed Dumplings: This is probably the one thing that I could eat at the buffet that had a decent flavor and texture. I think I ate 6 dumplings.\\nFried Chicken: The batter was overly crispy and the chicken meat was super dry. I couldn\\'t finish it. \\nPasta: There is a pasta bar that reuses the cocktail shrimp. There was nothing that special about it.\\nIce Cream: The ice cream is a soft serve vanilla or chocolate which wasn\\'t that special. It pretty much melts straight up when it lands in your ice cream bowl. \\n\\nService: The ladies here were nice but they also seemed to have the same sentiments that I did in wanting to be at the buffet. \\n\\nAnd to top it all off? I got a nice old stomach ache when I left the buffet and chowed down on some pepto bismol pills to help my stomach process all of the crappy food that I just ate. \\n\\nBottom line: I went here for free but I probably wouldn\\'t come back if you paid me. There is a McDonalds down the street, I\\'d rather dine there and get my $2.22 Big Mac.",
