    "text": "We love ramen and we readily try any new ramen place in town. There was a lot of expectation with Shoku Ramen being the sister store of ever popular (best burger in Las Vegas) Bachi Burger. I was quite impressed after our first visit here and promised myself I would come back. Tonight we had the Bacon Fried Rice for starters, it was unique and tasty. They have two varieties of Spicy Miso, regular and spicy. The regular already had the right amount of heat, any more and it would be bordering on painful and hard to enjoy. We also got the Buta-San which was also good. We enjoy our ramen served with a soft boiled egg extra. The flavors are right on but our only wish is for the pork slices to be cut more thinly. We love the melt-in-your mouth texture of thin and soft chasu like in Fukumimi Ramen or Monta. For dessert, the Black Sesame Ice Cream is always worth getting. Service is good, wait staff is very attentive. Overall, we were very happy with the experience and would be back... unless I\\'m drawn the great burgers next door.",
