    "text": "Michael Mina\\'s Signature and Seasonal Tasting Menu are both spectacular. Especially when paired together. They parallel each other well, each dish complimenting the other. The seafood was fresh and bursting with flavor. My favorite dish was the Domestic Caviar & Butternut Creme for how unique and full of flavor it was. I also loved the Miso-Glazed Chilean Sea Bass for its rich, tasty broth. And who could leave out their signature Lobster Pot Pie? It was thick and creamy with the perfect buttery flavor. I also had one of their drinks that had a cucumber vodka flavor--I cannot recall the name. It was delicious. In general, the wait staff was appropriate and I really appreciated they held our reservation without any problems while my guest was running a little late. The ambiance was elegant yet casual at the same time. You don\\'t have to whisper over your food and are able to really enjoy yourself. Their food is modern and innovative and worth the try. Enjoy!",
