    "text": "I\\'ve eaten here a few times and some things are better than others. The Tom kha soup is good. I\\'ve had it with chicken and shrimp, but I prefer the latter. I also liked the chicken curry which comes with potatoes, carrots and too many onions, but the pad thai was probably the worst I\\'ve ever had. I dont know if maybe because I ordered it with little spice or what, but it was so bland. Their food is super spicy too, on a scale of 1-5 I ordered a 1 and my nose was running. \\n\\nThe lunch special $7.95 and there are about 8 options to choose from. You also get a cup of bland rice soup, an eggroll and a fried wonton. Since this place is close to my work, I\\'ll probably come back when I\\'m in the mood for soup. But I\\'ll likely make the drive a little further for more flavorful food.",
