    "stars": "2",
    "date": "2011-03-31 00:00:00",
    "text": "We went in with high hopes after a friend recommended Delmonico but we left just a bit disappointed.  The ambiance was really nice and we were given a great table without a reservation but the food left a little to be desired.  \\n\\nMy friend and I both started with lobster bisque, which was good but a little thin.  We noticed right away too that she had 2 tiny little pieces of lobster in hers, but I had almost an entire small claw.  I was happy until I realized it was tough and rubbery.  I actually had to use a knife and fork to cut it into bite sized pieces.  My husband ordered the wedge salad as a starter and it was 80% white/yellow core.  Not what you would expect in a place as pricey as this.\\n\\nI ordered the fillet and it was cooked perfectly but it was not a great cut of meat.  Maybe I have high standards, but I think a $30+ fillet should be butter knife soft, but this one was kind of fibrous and hard to cut with a steak knife.  I didn\\'t really care for the seasoning either, but that\\'s a personal preference, not something I can count against the restaurant.  My husband\\'s rib eye was really fatty but he loved his twice baked potato.  I had the corn gratin for my side and it was tasty but again, not my style.  \\n\\nOur server was efficient but pretty standoffish.  When we first sat down, we ordered a bottle of \\\"Emerel\\'s Blend\\\" wine and he nicely suggested that we might want to try something else, but other than that, his interaction with us was a bit cold.  \\n\\nMaybe it was an off night, but I really expected more from a $400+ dinner.",
