    "stars": "2",
    "date": "2014-05-28 00:00:00",
    "text": "It\\'s airport food; what do you expect? It was my first time in Terminal B at McCarran, and since my flight was not for a while, I decided to venture and try something new. With a name like Great Steak & Potato, I thought of it as some unknown chain, and it probably is, but I decided to give it a shot. I mean, nothing too bad could happen on a one hour flight, right?\\n\\nAnd nothing too bad happened.\\n\\nI opted for the classic cheesesteak, and since I didn\\'t exactly know what Philly cheese was, I was unfortunately greeted with a sandwich with cheese sauce. While I like nacho cheese, I\\'m not too big of a fan of cheese sauce if not done right. It wasn\\'t done right. Personally, I thought I should have gotten the one with provolone, but I am bad with my cheeses, in general.\\n\\nFor the price and the size, about $9 for a 7\\\" cheesesteak, it was overall really underwhelming. It was a small shop as well, so seating was quite limited. Customers were literally fighting over that. Not that much fun when I had a flight within minutes.\\n\\nIf I had to go again, I would definitely try the one with provolone. However, to be honest, Jersey Mike\\'s in Terminal B is way better.\\n\\nTIP: N/A",
