    "text": "My first review on yelp. Only reason I\\'m doing this review is because of Delmonico\\'s Steakhouse at The Venetian. We were tired of the average buffets and fast food and we really wanted to have a fancy night. So we looked up on yelp for a nice fancy restaurant. We decided on Delmonico\\'s and called in to make reservations for two at 530. Came 530, we were still at the pool, so we called in and pushed the reservation to 630. Staff accommodated us, which was surprising. We came to restaurant at 630 and were seated immediately. The staff are on the dot with their reservations. Right after we were seated, the waiter asked what we would like to drink. I ordered a usual neat Johnny Walker Black Label and followed it with a 7&7. I believe every man should learn to love whiskey. My lady ordered a water lol. We then looked at the menu. I read all the reviews on yelp and just jumped straight to the assortment of steaks they had available. My lady ordered a New York T Bone Steak and I had the filet mignon. We also ordered the Butternut squash ravioli for the appetizer and mashed potatoes to eat with the steaks. \\n\\nFirst came ravioli. It was 5 pieces of ravioli. My first thought was,\\\"Damn I\\'m getting jipped out of 15 bucks\\\" But when I bit into the first piece of ravioli, I literally had an mouth orgasm... No homo. It was the best ravioli I ever had in my life. Hands down. I wish I had a whole plate full of it. My lady was hella impressed as well. \\n\\nThen came out the steaks. I hade mine cooked medium rare and she had hers done medium. The first bite was the best. Succulent, tender, easy to chew. Best steak I ever had in my life.",
