    "text": "YO THEY DON\\'T HAVE FREE EGG ROLLS WITH CHECK-IN ANYMORE.  Still a bomb pho place in Vegas tho, especially when in Vegas come hangover tyme.\\n\\nFollowing the recomendation first review I read, by Carly N, I ordered Bun Rieu. I\\'m not Vietnamese, so I can\\'t claim nostalgia for homemade Vietnamese food, but when I think Vegas and I think morning-after meals, I definitely feel a tinge of bitersweet longing for Kinh Do. This is the answer to all your woes.\\n\\nBUN RIEU - I have no native standards to go by, but wow this is an amazing bowl of noodle soup. If you like seafood and noodles and flavor and generous helpings of everything, order bun rieu.\\nEGG ROLLS - some of the best Vietnamese egg rolls I\\'ve had, even if they weren\\'t free. Delectably savory filling wrapped in deep fried crispy layers.  I really appreciate the plate of greens and pickles that came with. Definitely dipped some of that lettuce in my soup, because there is an unfortunate dearth of fresh produce in Sin City menus that leaves me dreaming of salad.\\nBUN BO HUE - decent. Hearty herby spicy and satisfying, but doesn\\'t stand out.\\nPHO - broth is solid. At some point, pho is pho is pho and Kinh Do does pretty good pho.\\nPHO GA - meh. Not impressed.\\nVIETNAMESE ICED COFFEE - nothing special; the coffee is a tad weak for my taste. But when it\\'s 100 degrees out and you\\'re hungover af, cold creamy coffee + a steaming bowl of noodle soup works something magical.",
