    "stars": "2",
    "date": "2016-12-20 00:00:00",
    "text": "\\\"Meh. I\\'ve experienced better.\\\" pretty much sums up MGM Grand Buffet.  My dinner was comped so I didn\\'t have to pay but had I paid, I would have been pretty upset.  Outside of crab legs and maybe shrimp cocktail, the buffet didn\\'t offer anything that I could consider \\'premium.\\'  The seafood was limited and their food was mediocre, at best.  After my initial first round, I didn\\'t find anything that I particularly wanted to go back to get seconds.  I would highly suggest avoiding the sushi as the rolls were most likely previously frozen and not fresh.  They have a station where you can customize your seafood dish and I didn\\'t like the fact that they served swordfish because 1) They\\'re not very good and 2) It\\'s not good for the ecosystem.  I found that most people end up getting swordfish because the only other fish that he can cook is tilapia and that\\'s a cheap & dirty fish.  \\n\\nOverall, a very disappointing experience.  I don\\'t remember MGM Grand Buffet being this bad but it looks like since no one goes to this buffet anymore (i.e. little to no line), they\\'ve also downgraded on the quality of what they serve.",
