    "stars": "5",
    "date": "2015-06-16 00:00:00",
    "text": "Yummy Grill and Sushi is a small Japanese, Chinese, and Hawaiian fusion restaurant.  It has a small dining room but large counter space for people that want to sit at the counter and be served sushi quickly.\\n\\nI like taking my family here on Sundays after church.  There is something for everyone here.  There is a lot of menu items.  I personally love the honey walnut shrimp and the cucumber salad.  My wife loves the philly hand rolls and a large bowl of udon noodles.  My daughter loves the tamago rolls and miso soup.\\n\\nThe food here is prepared and served quickly.  The prices are reasonable, which is why I come often.  I call this place a fast, casual restaurant.  The staff is friendly and will do all they can to make sure that you have a good experience.",
    "useful": "1",
