    "stars": "4",
    "date": "2017-08-20 00:00:00",
    "text": "Tea Space has been chillin\\' in my bookmarks for a long time and I was finally able to try it one random summer night. I think I\\'ve found one of my fave boba places!\\n\\nAfter a long night at UNLV, my fianc√© and I started to crave boba. We drove to Chewy and was immediately heartbroken to see it closed. We almost went to Tea Time but we didn\\'t wanna deal with bad customer service so we ended up here & thank goodness we did!\\n\\nTea Space is open late & this quaint little place has the friendliest workers. You walk in to a cute well-decorated place. They saw us struggling with choosing from their extensive menu and they were kind enough to give us their milk tea to try out. It was so good that my fianc√© ordered himself a large. I wanted something fruity though so I decided on mango black tea with lychee pieces. We also ordered takoyaki cause.. why not.\\n\\nThey brought two super tall glasses of our drinks and takoyaki served on a little pan. So cute! The milk tea is not too sweet and we didn\\'t adjust the sweetness so that\\'s a good thing. It\\'s creamy and the boba is chewy, but not too mushy. I loved my mango black tea too. It\\'s bright, not bitter, very fruity and refreshing. The takoyaki was lightly drizzled with the sauce and topped with a lot of yummy bonito flakes.\\n\\nTea Space is definitely in my top 5 right now!",
