    "text": "It was free, the workers were friendly, and there was plenty of variety. Why 2 stars?  Because, darnit, the food just wasn\\'t very good. When the best part of the meal is that the diet coke was pretty fizzy, you know it\\'s not worth $30. \\n\\nBut, let\\'s be honest: it was free with our stay at the Signature, and free is good. But DO NOT pay $30 to have dinner here. If it\\'s free, Bon appetit!",
