    "text": "The Orleans is always a place I like to frequent when I am in Vegas.  For some reason, I find their buffet to be a good value, and call me crazy, but they make a crazy-good tuna salad!! Yes, of all those options (including crawfish-not for me), I return again and again for some of that tuna!  Not the biggest or brightest buffet, but I am still a fan and will return each and every time.",
