    "text": "If you\\'re looking for craptastic service and mediocre food at caviar prices, check out the Delmonico inside the Venetian!\\n\\nIt started with the cocktail waitress who was so sassy it became bitchy, snipping short responses when our client asked a question. Then came our dinner server who was borderline rude. \\\"Are your seafood options listed here the only meat-free options you have? Most of them have sausage or some sort of meat in them,\\\" I inquired. \\\"Yep,\\\" was all he said before moving on... didn\\'t even offer to remove an ingredient or help me out in any way.\\n\\nThe food was pretty tasteless. An heirloom tomato salad had the most bang for the appetizer buck, but at $18 for four slices of tomato and a splooge of burrata, I could concoct a very similar version from my local farmer\\'s market for a fraction of the price. And it\\'s not that price is that huge of a factor here; if you\\'re going to Delmonico you are aware of the beefy tab that will come at the end of your meal... but when the service spits you aside, it\\'s not worth it.\\n\\nIf you\\'re wondering why two stars and not one - the second star is for the wine list, which shone brighter than the boring white walls inside this sub-standard steak joint.",
