    "text": "Marrakech is THE ultimate date spot, great for a gathering of friends you haven\\'t seen in awhile, or simply a spectacular experience! I have been going here for years and have enjoyed excellent food and fantastic service every time. \\n\\nThe restaurant itself is beautifully decorated and I love the low tables and cushion-like seating. The servers are all warm and timely in refilling wine and water while juggling all the courses of delish food and the belly dancers are always wonderful too! Bring some cash to tip the dancer and be prepared for her to teach you a move or two!\\n\\nThe food is absolutely amazing and you cannot beat the price anywhere in town! Course after course is beautifully presented to the table and everything tastes amazing! I cannot pick a favorite course so make sure that you arrive with a big appetite. \\n\\nOverall this place is a gem that I tell friends, family, and tourists alike that they MUST go!!!",
