    "text": "I Wish I could have tried my entr√©e! I had a party of six and two of my guests didn\\'t get an entr√©e. How do you bring out four entrees and forget two? They forgot about ladies first. What is chef Geno thinking, is he trying to make memories, or just make money. The service was 1 star. I understand this is a new restaurant, but with 4.2 million dollars to open they could have worked out the kinks. I appreciate chef working on a Monday, but why, it didn\\'t help anything. He must have been getting his jollies off with the bar crowd. $400 dollar meal with 4/6 entrees, get real! This place needs a wake up call. Your in the Aria, step up or bring in Chef David Burke. I would have rather eaten at bonefish grill.",
