    "stars": "1",
    "date": "2016-01-19 00:00:00",
    "text": "Don\\'t be fooled by the decor....this ramen joint is the single most disappointing flavorless example of ramen I\\'ve ever had the displeasure to pay for. The broth was a bowl of thin liquid devoid of even the slightest hint of pork flavor in any spoonful. I swear it was simply tan colored water with a slight sheen of some sort of oily substance masquerading itself as the expected pork fat goodness one finds at an actual ramen bar. Even the pork belly itself was as flavorless as the broth...it had the texture of actual pork but failed to provide even a tease of flavor. The noodles were white...that\\'s the best I can do with that. The eggs were there pleading to be released from the embarrassment of this $12 bowl of a ramen imposter. The only flavor came from a teaspoon of shredded pickled ginger haphazardly strewn in there where it most certainly did not belong.\\nI was honestly surprised that the Asians eating there weren\\'t jumping up and yelling \\\"FRAUD\\\". \\n\\nStay away and do yourself the favor of seeking out one of the delightful truthful ramen houses down on Spring Mountain.",
