    "text": "Don\\'t even waste your time or money. If I could put a zero I would. I usually like to keep my reviews positive, but this experience was horrible from start to finish. The only reason we went here is because we had free vouchers from the hotel. If we would have had to pay for this, we would have been severely disappointed. We waited in line for 20 minutes while there were many open tables. Everything we tried was terrible and we felt that we wasted so much food from everything we didn\\'t eat.  The best thing we had was the soft serve ice cream which is hard to mess up. Second best was the salad bar that we created ourselves from the ingredients available. Terrible items tried: pizza, brisket, ground beef nachos, kielbasa (the absolute worst! Couldn\\'t even choke it down), the lasagna, garlic bread...you get the picture I\\'m sure. With all that Vegas and the MGM Grand has to offer, I wouldn\\'t bother making this a stop during your stay.",
