    "text": "Came by Kinh Do for a quick hangover meal before the group split up to drive back. It was pretty empty, so we were seated quickly. \\n\\nThe biggest thing that pestered me here is their slow service. In a typical pho place, you sit down, get your order taken within 2 minutes, and a hot bowl comes out in no more than 10 minutes. Here, we waited a good 10 minutes before our order was taken, then another 5 to get water, then maybe 20-30 just to get our food. I understand there were 8 of us, but it still shouldn\\'t take that long. Maybe the workers were all just too busy watching the Wold Cup final game.\\n\\nI got a Com Thit Nuong (Grilled BBQ pork With Rice - $7.95). Broken rice was great, but the pork did not impress. Thin, dried out pieces. I\\'ve had better elsewhere. \\n\\nNot sure how the pho is, but rice dishes are mediocre. Combine that with really slow service and it\\'s not the most appealing place around. At least bathrooms are clean and the World Cup was on.",
