    "text": "My friends and I were at Container Park pretty late one Sunday evening (it was practically deserted) but wanted some food. Most everything was closed, but we found Cheffini\\'s right near the entrance of the park area. I ordered the Crunchy dog, with onions, red peppers, bacon bits, crushed potato chips, seaweed, sriracha mayo, mustard and fry sauce. Seriously though, I could have ordered anything off the menu and probably would have been very happy. There was a bit of a wait because they had just dropped a new batch of dogs, but I didn\\'t mind. The hot dog came out and it was glorious. Somehow all the crazy toppings complemented each other perfectly and it all tasted amazing. It was a bit too salty for my taste, but my boyfriend and I ate the whole thing and I probably could have shared another. They also have fries, empanadas, sliders and a burger option. You can get a beef dog, turkey dog, or a vegan dog too.\\n\\nIf you like gourmet hot dogs, do not miss this place if you\\'re in the area.",
