    "stars": "5",
    "date": "2015-11-22 00:00:00",
    "text": "Every sushi and dish we had represents Japan.  My wife found the restaurant from a blog of a Japanese resident of the town.  The location is off-the strip, and in a strip mall of the middle of Chinatown.  Nonetheless, the chef Takashi offered perfection of his creation.  We had nearly ten kinds of nigiri type sushi, fish on rice, plus grilled mackerel, fish cake stew, miso soup and pickled vegi.  Materials are very fresh, and precisely prepared.  Sushi rice was perfectly cooked and flavored. Of special note, the chef brighten up the flavor of salmon roe by marinating as the northern Japanese way.  The pickled vegi is also the northern Japanese version with rice based flavor.  Mackerel was nicely chosen and cooked perfectly.  The chef made great effort for the miso soup and fish cake stew, which can be recommended for every one who loves real Japanese food.  Another surprise came in the end, with the extremely generous size of bill.  I am sure that this restaurant will be the best sushi place in my town if he opens one. Or, I need to find a job in LV.",
