    "text": "This place is very much, what you see isn\\'t quite what you get. Although very visually appealing, the dogs were lacking in both quality and quantity for the price. I have had many \\\"custom\\\" and \\\"unique\\\" hotdogs and while I appreciate what they are trying to do here, it just fell short. Seemingly made to order dogs are topped with assembly line ingredients that you can tell are not fresh. I had the panchero dog and the saut√©ed onions were at least a day old. For the price I would expect all ingredients to be cooked fresh. Another reason I am giving a lower review is the staff, the girl at the counter today carried an attitude and was very unapproachable and unhelpful when it was clear I had not been before and didn\\'t know the menu. All in all if you are in Container Park I would try something else. This place was overpriced and definitely under delivered!",
