    "text": "This used to be a great place, but it has become too big for its britches. The food is nothing special, the service is terrible, and the staff are pretentious. The calling for a table on Yelp does not much good as after a 40 minute wait per the phone, we had to wait another 30 minutes once we arrived. Even the Thai tea was bland and unworth the expense. New host is a must and I would prefer if the waiters didn\\'t mention that they were going to take the food left in a to go container by a nearby former patron to the back for their own consumption.",
