    "text": "I hope this place does well. This is about the 4th Vietnamese restaurant that opened here since it\\'s inception. I call it the Death Corner. Previous restaurants have been good, but my theory is that the farther you move away from the strip, the higher the chance of failure. \\n\\nThis restaurant has all the right ingredients to make Vietnamese people happy. Good food. But that\\'s just it, good food doesn\\'t cut it when the majority of California Viets end up at Pho Kim Long because of proximity. What this place really need is a maitre d. \\n\\nAnyways, trust me, this is a good Vietnamese restaurant if you want good food. Let\\'s just leave it at that.",
