    "date": "2017-10-19 00:00:00",
    "text": "Being from Texas, we were a little aprehensive about going to a steakhouse in Las Vegas.  Almost immediately, our aprehension disapeared and turned into excitement.  The restaurant was very nice and elegant.  It was a little dark at first but our eyes adjusted quickly and it became apparant that BLT takes pride in their restaurant.  We spent the next few minutes admiring the decor and layout.\\n\\nWe were greeted by Leslie and Conrad (a great team I might add), and the experience just got better.  Conrad went to filling drinks while Leslie took the time to explain the menu and make suggestions (with no pressure).  All we can say is....WOW!  These two made an amazing team and really took care of us; and to be honest, even if the food was just good - because of them we would still come back.\\n\\nNow to the food, they started us out with a couple popovers, then followed by p√¢t√©.  Shortly after that we had our mixed drinks (Old Cuban\\'s, which are kind of like a hybrid between a Mojito and a Long Island, very good!).  The popovers were nothing short of amazing (and they give you the recipe!) and the p√¢t√© made me want to move in.  I know it sounds bad but I wouldn\\'t let go of the dish it came in until it was clean (no REALLY).  Next, we split a delicious salad, while still being pampared by Leslie and Conrad.  Finally came the steak (the Porterhouse for 2). \\n\\nIt was perfectly cooked (medium is our preference) and already sliced for sharing.  We also got two sides, truffle potatoes and stuffed mushrooms, both are a must!  At the first bite, we were hooked!  After all that food, we still finished all 36 mouthwatering ounces.  For dessert, we were too full so they brought us two amazing little brownies that satisfied our dessert cravings.\\n\\nWe cannot recommend BLT Steak enough!  It is already on our return list for next time we are in Las Vegas.",
