    "stars": "4",
    "date": "2015-06-22 00:00:00",
    "text": "I often search \\\"hot and new\\\" when I\\'m not particularly in the mood for something specific. I enjoy being the Guinea pig for a new restaurant in town!  ...aaaand this is how I ended up at Sushi Takashi for a solo dinner tonight!  \\n\\nI arrived at about 8:30, and the restaurant was pretty empty. Kawika was my server and took care of me from start to finish.  He filled my water, took my order, brought out all of my food, and took my dirty dishes.  He was very attentive and although it was slow, seemed to have that sense of urgency I appreciate in a full service restaurant. \\n\\nI ordered the $15.95 combo plate with 2 orders of teriyaki chicken and a half order of the Hakodate signature roll (yellowtail, ponzu, jalape√±o). To drink, I just had water. \\n\\nFood came out quick and was plated beautifully. I started with the salad which was definitely overdressed, but still delicious. I\\'ll ask for light dressing next time. The chicken was thin cut (love it when Japanese restaurants do this!) and the sauce was watery, but it didn\\'t seem to take away from the flavor. Maybe it\\'s just a house-made teriyaki sauce?!  Either way, no complaints.  The roll was delicious. I love when sushi rolls have slices of jalape√±o on top that are effective enough to taste + have a little bit of the seeds still attached. I hate those itty bitty small jalape√±o slices that some sushi places put on top. Where do they even get jalape√±os that small?!  Lol. \\n\\nMiso soup came with the meal and was ok.  I literally ate everything off of the plate, including the ginger. Lol. I was satisfied, but was craving something sweet...so I opted for the fried Oreos ($4.95).  How do you mess up fried Oreos?!  I mean, really you can\\'t!  Yum. Yum. Yum. \\n\\nMy check was $22, great value for what I got! \\n\\nI definitely want to come back with my boyfriend and go for the 12 course meal that I\\'ve read about from fellow yelpers!  Will update my review after I wake up from that coma. :)\\n\\nP.s. They have the best tasting \\\"tap water\\\" ever. I saw a sign on the wall that says its Fuji water or something...not sure what that is, but it was really good and definitely worth mentioning. I love when restaurants add little perks like that. It\\'s those small things that leave the biggest impact!",
