    "text": "Herringbone is a terrific restaurant and bar with a intimate vibe. A spectacular bar spans the entire interior wall. Sofa seating is terrific for cocktails and apps, but a little awkward for full meals. The patio space is absolute perfection, and my favorite outdoor dining space in Las Vegas. Austin is by far, one of the better waiters on The Strip. He orchestrates table service perfectly and knows the menu, wine and cocktail list well. Chef Geno Bernardo is at the top of his game, and everything is fantastic. We usually start with a shellfish platter (try the kimchee meuni√®re sauce), fresh fish crudo, and salads. The sea bass ceviche was the best I\\'ve ever had! Of the hot apps, I\\'m a fan of the octopus, calamari and meatballs. Geno\\'s meatballs and toast is probably my favorite plate. I could make a meal of it daily! I have a tough time getting to the entrees. I skip straight to the desserts. Don\\'t miss the sundae, carrot cake and cookies & milk. Oh, and the pannacotta... Herringbone won\\'t disappoint.",
