    "text": "PUSHY AND DECEPTIVE ,THEN TRY TO MAKE YOU PAY EXTRA! Came here with my girlfriend and her 7- year old daughter on a Sunday for the all you can eat for 12.99 per person ( they charged her daughter 10.99 ) We read online that they had two menus, but upon arriving they handed us one menu that was missing many items that was supposed to be on the second menu.That made me a bit apprehensive, and while I was trying to decide if it was still worth it, an older Asian woman encouraged us to sit and asked us what we wanted to drink -I told her Thai tea, but she insisted on a different tea-she said it would be very good-so I went along with what she recommended. While we were looking over the menu (since it was not a buffet already laid out ) the woman again very strongly encouraged us to order two of anything so \\\" we wouldn\\'t take all day\\\" . We ordered -as she insisted- two of each -egg rolls , chicken wings, potstickers, rice , and one bowl of pho. Everything we ordered was very small-usually just two or three pieces EXCEPT for the rice which was piled high on a big plate-enough to fill 5-6 people. After eating all of our food except for only being able to eat about a quarter of the rice plate,I asked for the check (since we were all stuffed) The woman then proceeded to tell me I had to finish eating the rice or I would be charged for another separate order. I thought she was joking, but she then said that I was wasting their food and I had to pay if I didn\\'t eat it! Talk about cheap!! First of all they didn\\'t even have all the items on the menu ( false advertising to get you inside) and then they don\\'t have any food prepared (as in a buffet) then they PUSH you to order too much( I wanted to just try one of each thing at first in case I didn\\'t like it) . Then they try to trick you by making you pay for whatever you can\\'t eat!!? The woman said she told me when I ordered that I would have to pay extra if I didn\\'t eat it all (TOTAL LIE!)\\nNeedless to say-I was angry and told her I wasn\\'t paying extra-my total for three people for LUNCH was already $50 , and it was not good at all -then I am given a total con line that I would expect at the strip from a street criminal! I left no tip and will not return -BEWARE!!",
