    "text": "If you\\'re leaning toward eating some Asian cuisine but not sure specifically what you want, Yummy Grill & Sushi might have what you\\'re looking for. Although a good portion of the menu is sushi, they have a broad menu covering other cuisines which is good for my family because not everyone is a fan of sushi like me.\\n\\nFour of us came on a Saturday night and decided to sit in the restaurant right by the open kitchen. But you can also order from the counter to go, pick up, or delivery. There were about three servers on the floor covering the 7 to 8 tables and the service was prompt and friendly. Wait time was minimal, orders were correct, questions were answered, and drinks were kept topped off.\\n\\nThe first two pages of the menu are sushi and the second half of the menu is split into Grill and Chinese sections. The Grill sections favors Japanese items but also has a little Hawaiian influence. From the sushi section, I\\'ll usually get the chirashi bowl has a nice variety of fish for the price. The nigiri and rolls are pretty average. Other family members order from their hand rolls which are the perfect portion and dirt cheap. My daughter has been on a spam musubi kick and she was happy that they offered it.\\n\\nI enjoyed the BBQ short ribs and was very pleased with the portion size and the seasoning on the ribs. They were grilled just right and served with a scoop of white rice and macaroni salad. Also ordered were the teriyaki beef and teriyaki chicken which come with the miso soup and a salad. My wife ordered the chicken lettuce wraps which of course I had one wrap and the chicken was well seasoned in fresh, crispy lettuce. Portions were large and about 3 boxes of food had to be taken home giving us good value for the $52 price tag for our four person meal.",
