    "text": "Marrakech is a must each time we visit Las Vegas. As soon as you enter, you are transported into another world. The value for your dollar is incredible with a 6 course meal for just under $50. You get an excellent harira soup, assorted Mediterranean dip platter, shrimp scampi, filet mignon kabobs, chicken with couscous platter, and a phenomenal traditional dessert called bastilla. The bread that is served with the shrimp scampi is incredible, but be careful not to fill up as there is more food on the way!\\n\\nBeyond the food, there is great entertainment with music and belly dancers. They encourage audience participation as well!\\n\\nThe staff and ownership are quite attentive to your needs while not being overbearing.\\n\\nIt is an experience not to be missed if you are in the area. Make sure to save up room before you go because the food is plentiful, but they are also more than willing to pack up your leftovers to go.",
