    "stars": "5",
    "date": "2010-11-23 00:00:00",
    "text": "My friend and I really wanted to try one of the best steakhouses in Vegas, and people kept telling us about how great Delmonico was, so we gave it a try. It was my friend\\'s birthday dinner and she is a huge meat eater, I on the other hand don\\'t actually like steak all that much, but WOW! It is absolutely impossible not to enjoy your meal here. \\n\\nWe were in a rush because we had tickets to a show and we were already running late. We advised our maitre d\\' that we had barely one hour to eat dinner and be on our way. He went above and beyond to make sure we got service fast and made the show on time. Not only was he absolutely efficient in making sure our food came out quickly, but he was also super friendly and attentive with us. \\n\\nOur cocktails took no time at all to arrive and were done perfectly. We didn\\'t have time to get appetizers which was a big disappointment, so we went straight for the main course. I had the rib eye and smashed potatoes, my friend had the fillet Mignon and fingerling potatoes, and we also shared some buttered asparagus. All the food was top notch and delicious. My rib eye was cooked to a perfect medium rare, and was well seared on the outside. Like I said, I don\\'t particularly like steak but this was mind blowing amazing! I had a few bites of my friend\\'s fillet Mignon and it was melt in your mouth goodness. I don\\'t know that it could be possible, but it was even better than my rib eye. Amazing. \\n\\nThe sides were also very good, specially the country smashed potatoes which were buttery and creamy. They had bacon and what I think were leeks in them. Yum. The asparagus were cooked to perfection and seasoned just right. I did not try the fingerling but my friend said she wasn\\'t overly impressed by them. \\n\\nMy friend was also surprised with an apple cider sorbet and a candle - for her birthday. The sorbet was delicious, light and refreshing. All in all our visit to Delmonico was fantastic and worth every single dollar we paid. Dinner here is pricey, but seriously if you find yourself in Las Vegas, you\\'d be crazy not to come here!",
