    "text": "Walking through Cesars Palace we stumbled up Cheesecake Factory.  Was disappointed at first when we were seated upstairs in a small table right next to the kitchen doors where there was foot traffic galore.  We spotted an open booth and they happily moved us.  Thank gosh because it was probably the most awkward place to sit especially on a first date!  Whatever you are looking for, Cheesecake Factory has it.  I become impressed with menus that have options for a lower calorie meal, although 600 calories doesnt seem that low to me!  I ordered the healthy delight salmon with veggies.  I could have finished the entire thing but didn\\'t want to look like a piglet! It was pretty great!  I was very pleased when in the mixed veggies a little bit of squash and eggplant was mixed in, it wasn\\'t your basic green beans and carrots.  Although, there was green beans and carrots!  But it was all so good!  Service was very kind, prompt, although I had to ask 3 times for a straw and still never received one!  \\nThe wait on a Friday night wasn\\'t long, I think we got there at a good time because it was packed!",
