    "stars": "4",
    "date": "2011-11-06 00:00:00",
    "text": "Dining at Marrakech has become a tradition of my friends\\' annual trip to Vegas and I was delighted to be able to join them this year. The restaurant is located off strip so prepared to take a cab. \\n\\nYes, the dining room is one large room and fairly small compared to other Vegas restaurants, but I liked the ambiance, finding that it lent to the intimacy of the experience. Guests are seated on couches at low tables. Be prepared to eat with your hands (they do provide rose water for cleansing before dining.) \\n\\nI enjoyed almost all of the food during the six courses served: warm bread, shrimp, soup, steak kabobs, chicken and rice, and a banana & chocolate souffle-type pastry. While the food wasn\\'t mind-blowing, I did enjoy it. \\n\\nBelly dancing is dispersed throughout the evening. The women will encourage others to get up and dance with them. I was too shy, but one of my friends got up and had a great time. \\n\\nOverall I\\'m looking forward to returning again should I make it to Vegas next year.",
