    "text": "As a vegan, I LOVE this place. My friends and I always struggle finding a decent place to eat after 10pm when most places close. I love that it\\'s open very, very late into the night. (Not to mention, eating their Ethiopian food while drunk is like heaven.) \\n\\nThe servers are nice- they smile to you and casually interact with you, unlike other Ethiopian restaurants I\\'ve been to, where they can hardly speak English and they\\'re difficult to be around.\\n\\nMore importantly, the service is ALWAYS SO QUICK and I\\'ve gone here at least a dozen times. Plus they even offer you extra injera (Ethiopian spongy, sourdough flatbread) every single time. \\n\\nAlmost forgot to mention the food, which is always DELICIOUS.",
