    "stars": "5",
    "date": "2014-01-30 00:00:00",
    "text": "Had dinner reservations at 6:30pm and we were seated right away.\\n\\nI looked at their menu prior to stepping foot into the restaurant so I kind of had an idea of what I would like to order.\\n\\nFor our appetizer, we ordered two Parmesan and Garlic potato chips. I\\'m a chip queen....obsessed and in love with chips but this....this didn\\'t taste that great. =/ The first five chips were good...but after awhile...it tasted WAY TOO GREASY. You know that over greased taste? Yeah...that\\'s what I was starting to taste. It felt like they drenched the entire thing in oil and left it there for days. My party finished the first plate of that but we just couldn\\'t finish the second plate. I definitely would NOT order this again. \\n\\nNEW ORLEANS GUMBO: This gumbo had rice, chicken, sausage and veggies. Pretty good sized portion for a bowl of soup. Small eaters would be half full from this. Seriously...lol. I thought to myself...damn...I hope I have enough room in my stomach for my entree!!!\\n\\nCAESAR SALAD: Typical normal Caesar. It\\'s big enough to share with your entire party.\\n\\nBONELESS RIB-EYE: You have your choice on the menu for bone-in OR boneless rib eye. I was with a fancy date and his party of four other high rollers so I didn\\'t wanna make a mess, that\\'s why I opted for boneless. I\\'ve got to admit...it was good...but to be technical, I would rate it at a solid B grade. My rib eye was cooked to my liking, the flavoring was delicious BUT......there were more fatty parts that I would like. =/ eh...not a big fan. But it didn\\'t take away from the complete meal. Great rib eye...big enough for leftovers the next day.\\n\\nNOTE: Three out of the six steak entrees my party ordered was over cooked. Someone wanted medium rare but her steak came out medium. My date ordered medium and it pretty much came out medium well.\\n\\nFor our side dishes we ordered potatoes au gratin, asparagus, mashed potatoes, and another veggie dish.\\n\\nCan\\'t go wrong with Delmonicos. Def give it a try! Be sure to make reservations.",
