    "text": "If you\\'re looking for sushi and football, this is the place for you. I was impressed by the number of TV screens populating this sushi lounge. There wasn\\'t a place you could sit and NOT see the Packers beat the Bears. Plus, it wasn\\'t crowded. \\n\\nWe grabbed a quick bite from their $7 special menu, which is available everyday from 11:30am-5pm. From the $7 selection, we ordered a spicy California, spicy yellowtail and eel roll. I also snagged a seaweed salad. If you know me, you know I am not obsessed with sushi, and I am incredibly sensitive to the slightest little fishiness. I could not handle the yellowtail as it tasted fishy, which to me means probably not the freshest, as I have had yellowtail elsewhere and found it quite tasty. However, my husband, who isn\\'t as sensitive thought it was just fine. The California roll was made with imitation crab, and the overall balance was a little mushy. The seaweed salad was standard. I wouldn\\'t say this should be your one sushi meal or even a destination sushi meal, but if you happen to be at Mandalay and need a quick bite at a reasonable price, it will do ya.\\n\\nPersonally, I would go back to sip on a pot of green tea and watch some football.",
